	(47,'PatentMD','1.0','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<xsd:schema xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" elementFormDefault=\"qualified\" attributeFormDefault=\"unqualified\">\r\n	<!--============================================================\r\n\r\n	 PatentMD: Fez Metadata Extension Schema for Patents\r\n		\r\n	============================================================-->\r\n	<xsd:element name=\"PatentMD\" type=\"PatentMDType\"/>\r\n	<xsd:element name=\"research_program\" />        \r\n	<xsd:element name=\"submitting_author\" />        \r\n	<xsd:element name=\"country_of_origin\" />        \r\n	<xsd:element name=\"patent_number\" />        \r\n	<xsd:complexType name=\"PatentMDType\">\r\n		<xsd:sequence>\r\n			<xsd:element ref=\"research_program\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"submitting_author\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"country_of_origin\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"patent_number\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n</xsd:schema>\r\n','PatentMD','',''),
	(48,'FezHistory','1.0','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<xsd:schema xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\">\r\n\r\n<!-- the root element for FezHistory-->\r\n<xsd:element name=\"FezHistory\" type=\"FezHistoryType\"/>\r\n\r\n<xsd:complexType name=\"FezHistoryType\">\r\n    <xsd:sequence>\r\n      <xsd:element name=\"audit\" type=\"auditType\" />\r\n    </xsd:sequence>\r\n</xsd:complexType>\r\n\r\n<xsd:complexType name=\"auditType\">\r\n  <xsd:sequence>\r\n        <xsd:element name=\"audit_id\"/>\r\n        <xsd:element name=\"audit_date\"/>\r\n        <xsd:element name=\"audit_user_id\"/>\r\n        <xsd:element name=\"audit_user_full_name\"/>\r\n        <xsd:element name=\"audit_justification\"/>\r\n        <xsd:element name=\"audit_pid\"/>\r\n        <xsd:element name=\"audit_dsID\"/>\r\n  </xsd:sequence>\r\n</xsd:complexType>\r\n\r\n\r\n</xsd:schema>\r\n','FezHistory','',''),
	(49,'vCard','3.0','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<schema\r\n	targetNamespace=\"http://www.w3.org/2001/vcard-rdf/3.0#\"\r\n	xmlns=\"http://www.w3.org/2001/XMLSchema\"\r\n	xmlns:xlink=\"http://www.w3.org/1999/xlink\"\r\n	xmlns:vCard=\"http://www.w3.org/2001/vcard-rdf/3.0#\"\r\n	elementFormDefault=\"qualified\"\r\n	attributeFormDefault=\"qualified\">\r\n\r\n\r\n	<annotation>\r\n		<documentation xml:lang=\"en\">\r\n			vCard XML Schema\r\n                        see http://imlsdcc.grainger.uiuc.edu/registry/default.asp\r\n			Created by Tom Habing, thabing@uiuc.edu\r\n\r\n			XML Schema for representing vCards in XML\r\n\r\n			This schema is based on the Representing vCard Objects in RDF/XML at the W3C http://www.w3.org/TR/vcard-rdf\r\n\r\n		$Workfile:   $ $Revision:   $\r\n\r\n    Last Updated by $Author:   $ on $Modtime:   $\r\n\r\n    $History: vCard.xsd $\r\n\r\n		</documentation>\r\n\r\n		<appinfo xmlns:dc=\"http://purl.org/dc/elements/1.1/\">\r\n			<dc:title>vCard XML Schema</dc:title>\r\n			<dc:creator>Tom Habing, thabing@uiuc.edu</dc:creator>\r\n			<dc:relation>http://www.w3.org/TR/vcard-rdf</dc:relation>\r\n			<dc:relation>ftp://ftp.isi.edu/in-notes/rfc2426.txt</dc:relation>\r\n		</appinfo>\r\n	</annotation>\r\n\r\n  <import namespace=\"http://www.w3.org/XML/1998/namespace\" schemaLocation=\"http://www.w3.org/2001/03/xml.xsd\"/>\r\n	<import namespace=\"http://www.w3.org/1999/xlink\" schemaLocation=\"http://www.loc.gov/standards/mets/version14/xlink.xsd\"/>\r\n\r\n	<element name=\"VCARD\">\r\n		<complexType>\r\n			<sequence>\r\n				<any namespace=\"##targetNamespace\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			\r\n\r\n	<element name=\"FN\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"NICKNAME\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"BDAY\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"MAILER\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"GEO\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"TITLE\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"ROLE\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"CATEGORIES\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"NAME\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"SOURCE\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"NOTE\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"PRODID\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"REV\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"SORT-STRING\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"CLASS\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"TEL\">\r\n		<complexType>\r\n    	<simpleContent>\r\n     		<extension base=\"string\">\r\n      		<attribute name=\"TYPE\" default=\"voice\">\r\n    				<simpleType>\r\n    					<list>\r\n    						<simpleType>\r\n        					<restriction base=\"string\">\r\n          					<enumeration value=\"home\"/>\r\n          					<enumeration value=\"msg\"/>\r\n          					<enumeration value=\"work\"/>\r\n          					<enumeration value=\"pref\"/>\r\n          					<enumeration value=\"voice\"/>\r\n          					<enumeration value=\"fax\"/>\r\n          					<enumeration value=\"cell\"/>\r\n          					<enumeration value=\"video\"/>\r\n          					<enumeration value=\"pager\"/>\r\n          					<enumeration value=\"bbs\"/>\r\n          					<enumeration value=\"modem\"/>\r\n          					<enumeration value=\"car\"/>\r\n          					<enumeration value=\"isdn\"/>\r\n          					<enumeration value=\"pcs\"/>\r\n        					</restriction>\r\n      					</simpleType>\r\n     					</list>\r\n    				</simpleType>\r\n      		</attribute>\r\n      		<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n     		</extension>\r\n    	</simpleContent>\r\n   	</complexType>\r\n	</element>\r\n\r\n	<element name=\"EMAIL\">\r\n		<complexType>\r\n    	<simpleContent>\r\n     		<extension base=\"string\">\r\n      		<attribute name=\"TYPE\" default=\"internet\">\r\n    				<simpleType>\r\n    					<list>\r\n    						<simpleType>\r\n        					<restriction base=\"string\">\r\n          					<enumeration value=\"internet\"/>\r\n          					<enumeration value=\"x400\"/>\r\n          					<enumeration value=\"pref\"/>\r\n        					</restriction>\r\n      					</simpleType>\r\n     					</list>\r\n    				</simpleType>\r\n      		</attribute>\r\n      		<attribute name=\"OTHERTYPE\" type=\"string\"/>\r\n      		<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n     		</extension>\r\n    	</simpleContent>\r\n   	</complexType>\r\n	</element>\r\n\r\n	<element name=\"ADR\">\r\n		<complexType>\r\n    	<sequence>\r\n    		<element name=\"Pobox\" minOccurs=\"0\"  maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Extadd\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Street\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Locality\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Region\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Pcode\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Country\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    	</sequence>\r\n   		<attribute name=\"TYPE\" default=\"intl postal parcel work\">\r\n 				<simpleType>\r\n 					<list>\r\n 						<simpleType>\r\n     					<restriction base=\"string\">\r\n       					<enumeration value=\"dom\"/>\r\n       					<enumeration value=\"intl\"/>\r\n       					<enumeration value=\"postal\"/>\r\n       					<enumeration value=\"parcel\"/>\r\n       					<enumeration value=\"home\"/>\r\n       					<enumeration value=\"work\"/>\r\n								<enumeration value=\"pref\"/>\r\n							</restriction>\r\n						</simpleType>\r\n					</list>\r\n 				</simpleType>\r\n   		</attribute>\r\n   		<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n   	</complexType>\r\n	</element>\r\n\r\n	<element name=\"ORG\">\r\n		<complexType>\r\n    	<sequence>\r\n    		<element name=\"Orgname\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Orgunit\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    	</sequence>\r\n    	<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n    </complexType>\r\n	</element>\r\n\r\n	<element name=\"N\">\r\n		<complexType>\r\n    	<sequence>\r\n    		<element name=\"Family\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Given\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Other\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Prefix\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Suffix\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    	</sequence>\r\n    	<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n    </complexType>\r\n	</element>\r\n\r\n	<element name=\"LABEL\">\r\n		<complexType>\r\n    	<complexContent mixed=\"true\">\r\n				<restriction base=\"anyType\">\r\n        	<sequence>\r\n         		<any processContents=\"lax\" minOccurs=\"0\" maxOccurs=\"0\"/>\r\n        	</sequence>\r\n     			<attribute name=\"TYPE\" default=\"intl postal parcel work\">\r\n   					<simpleType>\r\n   						<list>\r\n   							<simpleType>\r\n       						<restriction base=\"string\">\r\n         						<enumeration value=\"dom\"/>\r\n         						<enumeration value=\"intl\"/>\r\n         						<enumeration value=\"postal\"/>\r\n         						<enumeration value=\"parcel\"/>\r\n         						<enumeration value=\"home\"/>\r\n         						<enumeration value=\"work\"/>\r\n          					<enumeration value=\"pref\"/>\r\n      						</restriction>\r\n     						</simpleType>\r\n    					</list>\r\n   					</simpleType>\r\n     			</attribute>\r\n     			<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n     		</restriction>\r\n    	</complexContent>\r\n   	</complexType>\r\n	</element>\r\n\r\n	<element name=\"TZ\">\r\n		<complexType>\r\n    	<simpleContent>\r\n     		<extension base=\"string\">\r\n      		<attribute name=\"TYPE\">\r\n    				<simpleType>\r\n    					<list>\r\n    						<simpleType>\r\n        					<restriction base=\"string\">\r\n          					<enumeration value=\"text\"/>\r\n       						</restriction>\r\n      					</simpleType>\r\n     					</list>\r\n    				</simpleType>\r\n      		</attribute>\r\n      		<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n     		</extension>\r\n    	</simpleContent>\r\n   	</complexType>\r\n	</element>\r\n\r\n	<element name=\"UID\">\r\n		<complexType>\r\n    	<simpleContent>\r\n     		<extension base=\"string\">\r\n      		<attribute name=\"TYPE\" type=\"string\"/>\r\n      		<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n     		</extension>\r\n    	</simpleContent>\r\n   	</complexType>\r\n	</element>\r\n\r\n	<element name=\"PHOTO\" type=\"vCard:binaryElement\"/>\r\n\r\n	<element name=\"LOGO\" type=\"vCard:binaryElement\"/>\r\n\r\n	<element name=\"SOUND\" type=\"vCard:binaryElement\"/>\r\n\r\n	<element name=\"KEY\" type=\"vCard:binaryElement\"/>\r\n\r\n	<element name=\"AGENT\">\r\n		<complexType>\r\n			<sequence>\r\n				<any namespace=\"##targetNamespace\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			</sequence>\r\n			<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n		</complexType>\r\n	</element>\r\n\r\n	<element name=\"GROUP\">\r\n		<complexType>\r\n			<sequence>\r\n				<any namespace=\"##targetNamespace\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			</sequence>\r\n			<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n		</complexType>\r\n	</element>\r\n\r\n	<element name=\"URL\">\r\n		<complexType>\r\n			<attributeGroup ref=\"xlink:simpleLink\"/>\r\n		</complexType>\r\n	</element>\r\n</sequence>\r\n			<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n			<attribute ref=\"xml:base\" use=\"optional\"/>\r\n		</complexType>\r\n	</element>\r\n\r\n	<complexType name=\"simpleElement\">\r\n    <simpleContent>\r\n      <extension base=\"string\">\r\n        <attribute ref=\"xml:lang\" use=\"optional\"/>\r\n      </extension>\r\n    </simpleContent>\r\n  </complexType>\r\n\r\n	<complexType name=\"binaryElement\">\r\n  	<simpleContent>\r\n   		<extension base=\"base64Binary\">\r\n    		<attribute name=\"ENCODING\" default=\"b\">\r\n  				<simpleType>\r\n  					<list>\r\n  						<simpleType>\r\n      					<restriction base=\"string\">\r\n									<enumeration value=\"b\"/>\r\n									<enumeration value=\"\"/>\r\n        				</restriction>\r\n        			</simpleType>\r\n        		</list>\r\n        	</simpleType>\r\n        </attribute>\r\n    		<attribute name=\"TYPE\" type=\"string\"/>\r\n    		<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n    		<attributeGroup ref=\"xlink:simpleLink\"/>\r\n   		</extension>\r\n  	</simpleContent>\r\n 	</complexType>\r\n\r\n\r\n<!-- stuff from xlink.xsd -->\r\n\r\n  <!--  global attributes  --> \r\n  <attribute name=\"href\"  type=\"anyURI\"/>\r\n  <attribute name=\"role\" type=\"string\"/>\r\n  <attribute name=\"arcrole\" type=\"string\"/>\r\n  <attribute name=\"title\" type=\"string\" /> \r\n  <attribute name=\"show\">\r\n    <simpleType>\r\n      <restriction base=\"string\">\r\n	<enumeration value=\"new\" /> \r\n	<enumeration value=\"replace\" /> \r\n	<enumeration value=\"embed\" /> \r\n	<enumeration value=\"other\" /> \r\n	<enumeration value=\"none\" /> \r\n      </restriction>\r\n    </simpleType>\r\n  </attribute>\r\n  <attribute name=\"actuate\">\r\n    <simpleType>\r\n      <restriction base=\"string\">\r\n	<enumeration value=\"onLoad\" /> \r\n	<enumeration value=\"onRequest\" /> \r\n	<enumeration value=\"other\" /> \r\n	<enumeration value=\"none\" /> \r\n      </restriction>\r\n    </simpleType>\r\n  </attribute>\r\n  <attribute name=\"label\" type=\"string\" /> \r\n  <attribute name=\"from\" type=\"string\" /> \r\n  <attribute name=\"to\" type=\"string\" /> \r\n  <attributeGroup name=\"simpleLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"simple\" form=\"qualified\" /> \r\n    <attribute ref=\"xlink:href\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:role\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:arcrole\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:title\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:show\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:actuate\" use=\"optional\" /> \r\n  </attributeGroup>\r\n  <attributeGroup name=\"extendedLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"extended\" form=\"qualified\" /> \r\n    <attribute ref=\"xlink:role\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:title\" use=\"optional\" /> \r\n  </attributeGroup>\r\n  <attributeGroup name=\"locatorLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"locator\" form=\"qualified\" /> \r\n    <attribute ref=\"xlink:href\" use=\"required\" /> \r\n    <attribute ref=\"xlink:role\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:title\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:label\" use=\"optional\" /> \r\n  </attributeGroup>\r\n  <attributeGroup name=\"arcLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"arc\" form=\"qualified\" /> \r\n    <attribute ref=\"xlink:arcrole\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:title\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:show\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:actuate\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:from\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:to\" use=\"optional\" /> \r\n  </attributeGroup>\r\n  <attributeGroup name=\"resourceLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"resource\" form=\"qualified\" /> \r\n    <attribute ref=\"xlink:role\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:title\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:label\" use=\"optional\" /> \r\n  </attributeGroup>\r\n  <attributeGroup name=\"titleLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"title\" form=\"qualified\" /> \r\n  </attributeGroup>\r\n  <attributeGroup name=\"emptyLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"none\" form=\"qualified\" /> \r\n  </attributeGroup>\r\n\r\n\r\n<!-- xml.xsd -->\r\n\r\n  <attribute name=\"lang\" type=\"language\">\r\n  <annotation>\r\n   <documentation>In due course, we should install the relevant ISO 2- and 3-letter\r\n         codes as the enumerated possible values . . .</documentation>\r\n  </annotation>\r\n </attribute>\r\n\r\n <attribute name=\"space\" default=\"preserve\">\r\n  <simpleType>\r\n   <restriction base=\"NCName\">\r\n    <enumeration value=\"default\"/>\r\n    <enumeration value=\"preserve\"/>\r\n   </restriction>\r\n  </simpleType>\r\n </attribute>\r\n\r\n <attribute name=\"base\" type=\"anyURI\">\r\n  <annotation>\r\n   <documentation>See http://www.w3.org/TR/xmlbase/ for\r\n                     information about this attribute.</documentation>\r\n  </annotation>\r\n </attribute>\r\n\r\n <attributeGroup name=\"specialAttrs\">\r\n  <attribute ref=\"xml:base\"/>\r\n  <attribute ref=\"xml:lang\"/>\r\n  <attribute ref=\"xml:space\"/>\r\n </attributeGroup>\r\n\r\n\r\n\r\n\r\n</schema>\r\n','VCARD','v',''),
	(50,'geospatialMD','1.0','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<xsd:schema xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" elementFormDefault=\"qualified\" attributeFormDefault=\"unqualified\" version=\"0.6.50\">\r\n	<xsd:annotation>\r\n		<xsd:documentation>\r\n		**********************************************************************  Overview  **************************************************************\r\n				This is an ADN item-level CATEGORY schema.\r\n				Tags defined: geospatialCoverages\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>*** LICENSE INFORMATION *****\r\n  		Copyright 2002, 2003 DLESE Program Center\r\n		University Corporation for Atmospheric Research (UCAR)\r\n		P.O. Box 3000, Boulder, CO 80307, United States of America\r\n		email: support@dlese.org. \r\nThese schemas are free software; you can redistribute them and/or modify them under the terms of the GNU General Public License as published by the Free Software Foundation; either version 2 of the License, or (at your option) any later version.  These schemas are distributed in the hope that they will be useful, but WITHOUT ANY WARRANTY; without even the implied warranty of MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE. See the GNU General Public License for more details. You should have received a copy of the GNU General Public License along with this project; if not, write to the Free Software Foundation, Inc., 59 Temple Place, Suite 330, Boston, MA 02111-1307 USA  \r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>***********************  Other CATEGORY Schemas to Include  ********************************</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>************************  VOCABULARY Schemas to Include  ***********************************</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>************************  ROOT Element  **********************************************\r\n							There is no root element for this schema.\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>************************  Other Elements  **********************************************</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>************************  Complex Types  (alpha order) *****************************\r\n	\r\n				bodyType  	  				is part of geospatialCoverageType			\r\n				boundBoxType				is part of geospatialCoverageType\r\n				coordinateSystemType		is part of geospatialCoverageType\r\n				detGeoType 					is part of detGeosType\r\n				detGeosType 				is part of geospatialCoverageType\r\n				eventsType  					is part of bbEvents and detailedEvents under boundBoxType and detGeoType\r\n				geospatialCoverageType  	is part of geospatialCoveragesType\r\n				geospatialCoveragesType 	is part of ADNmetdataType in record.xsd \r\n				placeOrEventType			is part of placesType and eventsType\r\n				placesType  					is part of bbPlaces and detailedPlaces under boundBoxType and detGeoType\r\n				projectionType 				is part of geospatialCoverageType\r\n				vertType  						is part of boundBoxType.bbVert and detGeoType.detVert\r\n				vertMinMaxType  			is part of boundBoxType and detGeoType\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:complexType name=\"bodyType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  bodyType  ***************************************************\r\n				These elements have the following types or schema associated with them.\r\n				planet						is a simple type; see planet.xsd\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:choice>\r\n			<xsd:element name=\"planet\" type=\"planetType\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"otherPlanetaryBody\" type=\"stringTextType\" maxOccurs=\"1\"/>\r\n		</xsd:choice>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"boundBoxType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  boundBoxType  ***************************************************\r\n				These elements have the following types or schema associated with them.\r\n				westCoord				is a simple type with a patterned decimal\r\n				eastCoord				is a simple type with a patterned decimal\r\n				northCoord				is a simple type with a patterned decimal\r\n				southCoord				is a simple type with a patterned decimal\r\n				bbSrcName				is simple; see commonfields.xsd\r\n				bbSrcIDandURL			is complex; see commonfields.xsd\r\n				bbSrcDesc				is simple; see commonfields.xsd\r\n				bbAccEst				is simple; see commonfields.xsd\r\n				description				is a global; see commonfields.xsd\r\n				bbVert					is complex; no vocab; just child elements\r\n				bbPlaces				is complex; no vocab; just child elements\r\n				bbEvents				is complex; no vocab; just child elements\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:all>\r\n			<xsd:element name=\"westCoord\" type=\"longitudeType\" minOccurs=\"1\" maxOccurs=\"1\" nillable=\"false\"/>\r\n			<xsd:element name=\"eastCoord\" type=\"longitudeType\" minOccurs=\"1\" maxOccurs=\"1\" nillable=\"false\"/>\r\n			<xsd:element name=\"northCoord\" type=\"latitudeType\" minOccurs=\"1\" maxOccurs=\"1\" nillable=\"false\"/>\r\n			<xsd:element name=\"southCoord\" type=\"latitudeType\" minOccurs=\"1\" maxOccurs=\"1\" nillable=\"false\"/>\r\n			<xsd:element name=\"bbSrcName\" type=\"stringTextType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"bbSrcIDandURL\" type=\"IDandURLType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"bbSrcDesc\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"bbAccEst\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element ref=\"description\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"bbVert\" type=\"vertType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"bbPlaces\" type=\"placesType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"bbEvents\" type=\"eventsType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n		</xsd:all>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"coordinateSystemType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  coordinateSystemType  *************************************************\r\n				These elements have the following types or schema associated with them.\r\n				type				is a an attribute with a controlled vocab; see coordinateDLESE.xsd\r\n				\r\n				The content of the element is a string with information about the coordinate system.\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"type\" type=\"union.coordinateSystemType\" use=\"required\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"detGeoType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  detGeoType ***************************************************\r\n				These elements have the following types or schema associated with them.\r\n				typeDetGeo				is a simple; see typeDetGeo.xsd\r\n				geoNumPts				is simple\r\n				geoPtOrder				is a simple; see geoPtOrder.xsd\r\n				longLat					is complex\r\n				detSrcName				is simple; see commonfields.xsd\r\n				detSrcIDandURL			is a complex; see commonfields.xsd\r\n				detSrcDesc				is simple; see commonfields.xsd\r\n				detAccEst				is simple; see commonfields.xsd\r\n				description				is a global; see commonfields.xsd\r\n				detVert					is complex; no vocab; just child elements\r\n				detPlaces				is complex; no vocab; just child elements\r\n				detEvents				is complex; no vocab; just child elements\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:all>\r\n			<xsd:element name=\"typeDetGeo\" type=\"typeDetGeoType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"geoNumPts\" type=\"xsd:positiveInteger\" minOccurs=\"1\" maxOccurs=\"1\" nillable=\"false\"/>\r\n			<xsd:element name=\"geoPtOrder\" type=\"geoPtOrderType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"longLats\" type=\"longLatsType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"detSrcName\" type=\"stringTextType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"detSrcIDandURL\" type=\"IDandURLType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"detSrcDesc\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"detAccEst\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element ref=\"description\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"detVert\" type=\"vertType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"detPlaces\" type=\"placesType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"detEvents\" type=\"eventsType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n		</xsd:all>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"detGeosType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  detGeosType  *************************************************\r\n				These elements have the following types or schema associated with them.\r\n				detGeo				is complex\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:sequence>\r\n			<xsd:element name=\"detGeo\" type=\"detGeoType\" minOccurs=\"1\" maxOccurs=\"unbounded\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"eventsType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  eventsType  *************************************************\r\n				These elements have the following types or schema associated with them.\r\n				event				is complex\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:sequence>\r\n			<xsd:element name=\"event\" type=\"placeOrEventType\" minOccurs=\"1\" maxOccurs=\"unbounded\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"geospatialCoverageType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				*************************************** geospatialCoverageType  *************************************************\r\n				These elements have the following types or schema associated with them.\r\n				body							is complex\r\n				geodeticDatumGlobalOrHorz		is a simple type; see geodeticDatumGlobalorHorz.xsd; Unknown and Other part of formal vocab so no use default.xsd\r\n				projection						is complex with an attribute that has a controlled vocab\r\n				coordinateSystem				is complex with an attribute that has a controlled vocab\r\n				boundBox						is complex\r\n				detGeo							is complex\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:all>\r\n			<xsd:element name=\"body\" type=\"bodyType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"geodeticDatumGlobalOrHorz\" type=\"union.geodeticDatumGlobalOrHorzType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"projection\" type=\"projectionType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"coordinateSystem\" type=\"coordinateSystemType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"boundBox\" type=\"boundBoxType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"detGeos\" type=\"detGeosType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n		</xsd:all>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"geospatialCoveragesType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  geospatialCoveragesType  *************************************************\r\n				These elements have the following types or schema associated with them.\r\n				geogspatialCoverage				is complex\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:sequence>\r\n			<xsd:element name=\"geospatialCoverage\" type=\"geospatialCoverageType\" minOccurs=\"1\" maxOccurs=\"unbounded\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"longLatType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  longLatType*************************************************\r\n				These elements have the following types or schema associated with them.\r\n				longitude				is a simple type\r\n				latitude					is a simple type\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"longitude\" type=\"longitudeType\" use=\"required\"/>\r\n				<xsd:attribute name=\"latitude\" type=\"latitudeType\" use=\"required\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"longLatsType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  longLatsType*************************************************\r\n				These elements have the following types or schema associated with them.\r\n				longLat				is a simple type\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:sequence>\r\n			<xsd:element name=\"longLat\" type=\"longLatType\" minOccurs=\"1\" maxOccurs=\"unbounded\" nillable=\"true\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"placeOrEventType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  placeOrEventType  ********************************************\r\n				These elements have the following types or schema associated with them.\r\n				name				is a global; see commonfields.xsd\r\n				source				is a global; see commonfields.xsd\r\n				IDandURL			is complex; see commonfields.xsd\r\n				sourceDesc			is a global; see commonfields.xsd\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:all>\r\n			<xsd:element ref=\"name\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element ref=\"source\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"IDandURL\" type=\"IDandURLType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element ref=\"sourceDesc\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n		</xsd:all>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"placesType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  placesType  ************************************************\r\n				These elements have the following types or schema associated with them.\r\n				place					is complex\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:sequence>\r\n			<xsd:element name=\"place\" type=\"placeOrEventType\" minOccurs=\"1\" maxOccurs=\"unbounded\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"projectionType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  projectionType  *************************************************\r\n				These elements have the following types or schema associated with them.\r\n				type				is a an attribute of simple type\r\n				\r\n				Uknown and Other are part of formal vocab so no use default.xsd\r\n				Otherwise the content of the element is a string with information about the projection.\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"type\" type=\"union.projectionType\" use=\"required\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"vertBaseInfoType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  vertBaseInfoType  *************************************************\r\n				These elements have the following types or schema associated with them.\r\n				vertBaseType	see vertBase.xsd\r\n				desc				information about the vertical base level; often describes the datum used\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"vertBaseType\">\r\n				<xsd:attribute name=\"desc\" type=\"xsd:string\" use=\"optional\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"vertType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  vertType  ***************************************************\r\n				These elements have the following types or schema associated with them.\r\n				geodeticDatumGlobalOrVert		is a simpl; see geodeticDatumGlobalOrVert.xsd; Unknown and Other part of formal vocab so no use default.xsd \r\n				vertBase							is complex;\r\n				vertMin							is complex; a decimal with a controlled vocab attribute in verticalUnits.xsd\r\n				vertMax							is complex; a decimal with a controlled vocab attribute in verticalUnits.xsd\r\n				vertAcc							is complex; non-empty string; see commonfields.xsd\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:all>\r\n			<xsd:element name=\"geodeticDatumGlobalOrVert\" type=\"union.geodeticDatumGlobalOrVertType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"vertBase\" type=\"vertBaseInfoType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"vertMin\" type=\"vertMinMaxType\" minOccurs=\"1\" maxOccurs=\"1\" nillable=\"false\"/>\r\n			<xsd:element name=\"vertMax\" type=\"vertMinMaxType\" minOccurs=\"1\" maxOccurs=\"1\" nillable=\"false\"/>\r\n			<xsd:element name=\"vertAcc\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n		</xsd:all>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"vertMinMaxType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  vertMinMaxType  *************************************************\r\n				These elements have the following types or schema associated with them.\r\n				units				is a an attribute with a controlled vocab; see verticalUnits.xsd\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:decimal\">\r\n				<xsd:attribute name=\"units\" type=\"verticalUnitsType\" use=\"required\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:annotation>\r\n		<xsd:documentation>***********************  Simple Types (alpha order) *************************************\r\n\r\n				latitudeType									is a patterned decimal\r\n				longitudeType								is a patterned decimal\r\n				longLatType									is a patterned string\r\n\r\n				union.geodeticDatumGlobalOrHorzType		see geodeticDatumGlobalOrHorzDLESE.xsd;Unknown and Other part of formal vocab so no use default.xsd\r\n				union.geodeticDatumGlobalOrVertType		see geodeticDatumGlobalOrVertDLESE.xsd;Unknown and Other part of formal vocab so no use default.xsd\r\n				union.projectionType						see projectionDLESE.xsd\r\n				union.coordinateSystemType				see coordinateDLESE.xsd\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:simpleType name=\"latitudeType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  latitudeType  ***********************************************\r\n				The pattern element is added to ensure that a null tag set is *not* interpreted as a value of zero.\r\n				A pattern of ([+-][0-9]{2}(\\.[0-9]{2})) is too strict a requirement because it forces 9.2 to be 09.20\r\n				A pattern of  -?\\d{1,2}\\.\\d{1,2} is also too strict in that is requires a decimal.\r\n				Decimal degrees is assumed.\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:decimal\">\r\n			<xsd:minInclusive value=\"-90.00\"/>\r\n			<xsd:maxInclusive value=\"90.00\"/>\r\n			<xsd:totalDigits value=\"4\"/>\r\n			<xsd:fractionDigits value=\"2\"/>\r\n			<xsd:pattern value=\"-?\\d{0,2}\\.?\\d{1,2}\" />\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"longitudeType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  longitudeType  ***********************************************\r\n				The pattern element is added to ensure that a null tag set is *not* interpreted as a value of zero.\r\n				A pattern of ([+-][0-9]{3}(\\.[0-9]{2})) is too strict a requirement because it forces 9.2 to be 009.20\r\n				A pattern of -?1?\\d{1,2}\\.\\d{1,2} is also too strict in that it requires a decimal to be present.\r\n				Decimal degrees is assumed.\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:decimal\">\r\n			<xsd:minInclusive value=\"-180.00\"/>\r\n			<xsd:maxInclusive value=\"180.00\"/>\r\n			<xsd:totalDigits value=\"5\"/>\r\n			<xsd:fractionDigits value=\"2\"/>\r\n			<xsd:pattern value=\"-?\\d{0,3}\\.?\\d{1,2}\" />\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"union.geodeticDatumGlobalOrHorzType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				**************************  union.geodeticDatumGlobalOrHorzType  ******************************\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:union memberTypes=\"DLESEgeodeticDatumGlobalOrHorzType\"/>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"union.geodeticDatumGlobalOrVertType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				**************************  union.geodeticDatumGlobalOrVertType  ******************************\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:union memberTypes=\"DLESEgeodeticDatumGlobalOrVertType\"/>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"union.coordinateSystemType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				**************************  union.coordinateSystemType  ******************************\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:union memberTypes=\"DLESEcoordinateType\"/>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"union.projectionType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				**************************  union.projectionType  ******************************\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:union memberTypes=\"DLESEprojectionTypesType\"/>\r\n	</xsd:simpleType>\r\n\r\n\r\n        <xsd:simpleType name=\"DLESEcoordinateType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  DLESEcoordinateType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"DLESE:Geographic latitude and longitude\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"DLESEcoordinateLeafType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  DLESEcoordinateLeafType  *****************************************\r\n				Lists leaf values\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"Geographic latitude and longitude\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n\r\n        <xsd:simpleType name=\"DLESEgeodeticDatumGlobalOrHorzType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  geodeticGlobalOrHorzType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"DLESE:WGS72\"/>\r\n			<!--WGS72 is a global geodetic system-->\r\n			<xsd:enumeration value=\"DLESE:WGS84\"/>\r\n			<!--WGS84 is a global geodetic system-->\r\n			<xsd:enumeration value=\"DLESE:PZ-90\"/>\r\n			<!--PZ-90 is global:Russian analog to WGS84-->\r\n			<xsd:enumeration value=\"DLESE:NAD27\"/>\r\n			<!--NAD27 is a horizontal datum: North American Datum from 1927-->\r\n			<xsd:enumeration value=\"DLESE:NAD83\"/>\r\n			<!--NAD83 is a horizontal datum: North American Datum from 1983-->\r\n			<xsd:enumeration value=\"DLESE:ATS77\"/>\r\n			<!--ATS77 is a horizontal datum-->\r\n			<xsd:enumeration value=\"DLESE:Other\"/>\r\n			<!--the attribute datumGH will indicate whether the datum is horizontal or global-->\r\n			<xsd:enumeration value=\"DLESE:Unknown\"/>\r\n			<!--if this value is entered will still get info if have lat/long-->\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"DLESEgeodeticDatumGlobalOrHorzLeafType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  DLESEgeodeticDatumGlobalOrHorzLeafType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"WGS72\"/>\r\n			<!--WGS72 is a global geodetic system-->\r\n			<xsd:enumeration value=\"WGS84\"/>\r\n			<!--WGS84 is a global geodetic system-->\r\n			<xsd:enumeration value=\"PZ-90\"/>\r\n			<!--PZ-90 is global:Russian analog to WGS84-->\r\n			<xsd:enumeration value=\"NAD27\"/>\r\n			<!--NAD27 is a horizontal datum: North American Datum from 1927-->\r\n			<xsd:enumeration value=\"NAD83\"/>\r\n			<!--NAD83 is a horizontal datum: North American Datum from 1983-->\r\n			<xsd:enumeration value=\"ATS77\"/>\r\n			<!--ATS77 is a horizontal datum-->\r\n			<xsd:enumeration value=\"Other\"/>\r\n			<!--the attribute datumGH will indicate whether the datum is horizontal or global-->\r\n			<xsd:enumeration value=\"Unknown\"/>\r\n			<!--if this value is entered will still get info if have lat/long-->\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n        \r\n	<xsd:annotation>\r\n		<xsd:documentation>\r\n		**********************************************************************  Overview  **************************************************************\r\n			Definition: 			Controlled vocabulary schema for DLESE metadata frameworks\r\n			Framework use: 	ADN-I (item)\r\n			Source org:			Government of Ontario Information and Technology Standards; http://www.gov.on.ca/MBS/techstan/\r\n			Source values:		http://www.gov.on.ca/MBS/techstan/72-00apa.htm\r\n			Source last update:	1996\r\n			DPC last update:		2002-10-31\r\n			Notes: 	\r\n			NAVD29 is National Geodetic Vertical Datum of 1929			\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>2003-2-6: Definition: Verical datum is a base reference for a coordinate system. It includes the position of an initial point of orgin and the orientation of an ellipsoid that models the surface of the earh in the region of interest.\r\n2003-2-6: There are horizontal, veritcal and global datums.\r\n2003-2-6: The schema has both global and vertical datums with global datums listed first.\r\n2003-2-6: Added DLESE: and kept Other to the vocab because there are so many local vertical datums that could be used.\r\n2003-2-6: Removed vocab term Unknown because vertical measurements can\'t have an unknown datum while they can have an Other\r\n2003-2-6: Added Sea level because it is the most popular vertical reference point.\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>***********************  Simple Types (alpha order) *************************************</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:simpleType name=\"DLESEgeodeticDatumGlobalOrVertType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  geodeticGlobalOrVertType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"DLESE:WGS72\"/>\r\n			<!--WGS72 is a global geodetic system-->\r\n			<xsd:enumeration value=\"DLESE:WGS84\"/>\r\n			<!--WGS84 is a global geodetic system-->\r\n			<xsd:enumeration value=\"DLESE:PZ-90\"/>\r\n			<!--PZ-90 is global:Russian analog to WGS84-->\r\n			<xsd:enumeration value=\"DLESE:CGD28-CDN\"/>\r\n			<!--CGD28-CDN is a vertical datum used in Canada-->\r\n			<xsd:enumeration value=\"DLESE:NAVD29-USA\"/>\r\n			<!--NAVD29 is a vetical datum used in North American, est. 1929-->\r\n			<xsd:enumeration value=\"DLESE:NAVD88\"/>\r\n			<!--NAVD88 is a vertical datum used in North American, est. 1988-->\r\n			<xsd:enumeration value=\"DLESE:IGLD55\"/>\r\n			<!--IGLD55 is a vertical datum-->\r\n			<xsd:enumeration value=\"DLESE:IGLD88\"/>\r\n			<!--IGLD88 is a vertical datum-->\r\n			<xsd:enumeration value=\"DLESE:Sea level\"/>\r\n			<!-- Sea level is vertical datum-->\r\n			<xsd:enumeration value=\"DLESE:Other\"/>\r\n			<!-- the attribute datumGV will indicate whether it is veritcal or horizontal-->\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"DLESEgeodeticDatumGlobalOrVertLeafType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  DLESEgeodeticDatumGlobalOrVertLeafType  ***********************\r\n				Lists leaf values\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"WGS72\"/>\r\n			<!--WGS72 is a global geodetic system-->\r\n			<xsd:enumeration value=\"WGS84\"/>\r\n			<!--WGS84 is a global geodetic system-->\r\n			<xsd:enumeration value=\"PZ-90\"/>\r\n			<!--PZ-90 is global:Russian analog to WGS84-->\r\n			<xsd:enumeration value=\"CGD28-CDN\"/>\r\n			<!--CGD28-CDN is a vertical datum used in Canada-->\r\n			<xsd:enumeration value=\"NAVD29-USA\"/>\r\n			<!--NAVD29 is a vetical datum used in North American, est. 1929-->\r\n			<xsd:enumeration value=\"NAVD88\"/>\r\n			<!--NAVD88 is a vertical datum used in North American, est. 1988-->\r\n			<xsd:enumeration value=\"IGLD55\"/>\r\n			<!--IGLD55 is a vertical datum-->\r\n			<xsd:enumeration value=\"IGLD88\"/>\r\n			<!--IGLD88 is a vertical datum-->\r\n			<xsd:enumeration value=\"Sea level\"/>\r\n			<!-- Sea level is vertical datum-->\r\n			<xsd:enumeration value=\"Other\"/>\r\n			<!-- the attribute datumGV will indicate whether it is veritcal or horizontal-->\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n\r\n        <xsd:simpleType name=\"geoPtOrderType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>*****  geoPtOrderType  *****</xsd:documentation>\r\n			<xsd:documentation>indicates how to interpret a polygon or bounding box based on the geographic footprint</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"Inside\"/>\r\n			<xsd:enumeration value=\"Outside\"/>\r\n			<xsd:enumeration value=\"None\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n\r\n        <xsd:simpleType name=\"planetType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  planetVocabType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"Mercury\"/>\r\n			<xsd:enumeration value=\"Venus\"/>\r\n			<xsd:enumeration value=\"Earth\"/>\r\n			<xsd:enumeration value=\"Mars\"/>\r\n			<xsd:enumeration value=\"Jupiter\"/>\r\n			<xsd:enumeration value=\"Saturn\"/>\r\n			<xsd:enumeration value=\"Uranus\"/>\r\n			<xsd:enumeration value=\"Neptune\"/>\r\n			<xsd:enumeration value=\"Pluto\"/>\r\n			<xsd:enumeration value=\"Earth\'s Moon\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n\r\n        <xsd:simpleType name=\"DLESEprojectionTypesType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  DLESEprojectionTypesType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"DLESE:Albers conical equal area\"/>\r\n			<xsd:enumeration value=\"DLESE:Does not apply\"/>\r\n			<xsd:enumeration value=\"DLESE:Lambert azimuthal equal area\"/>\r\n			<xsd:enumeration value=\"DLESE:Lambert conformal conic\"/>\r\n			<xsd:enumeration value=\"DLESE:Mercator\"/>\r\n			<xsd:enumeration value=\"DLESE:Other\"/>\r\n			<xsd:enumeration value=\"DLESE:Polar stereographic\"/>\r\n			<xsd:enumeration value=\"DLESE:Transverse Mercator\"/>\r\n			<xsd:enumeration value=\"DLESE:Space oblique Mercator\"/>\r\n			<xsd:enumeration value=\"DLESE:Unknown\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"DLESEprojectionTypesLeafType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  DLESEprojectionTypesLeafType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"Albers conical equal area\"/>\r\n			<xsd:enumeration value=\"Does not apply\"/>\r\n			<xsd:enumeration value=\"Lambert azimuthal equal area\"/>\r\n			<xsd:enumeration value=\"Lambert conformal conic\"/>\r\n			<xsd:enumeration value=\"Mercator\"/>\r\n			<xsd:enumeration value=\"Other\"/>\r\n			<xsd:enumeration value=\"Polar stereographic\"/>\r\n			<xsd:enumeration value=\"Transverse Mercator\"/>\r\n			<xsd:enumeration value=\"Space oblique Mercator\"/>\r\n			<xsd:enumeration value=\"Unknown\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n\r\n        <xsd:simpleType name=\"typeDetGeoType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  typeDetGeoType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"Point\"/>\r\n			<xsd:enumeration value=\"Bounding box\"/>\r\n			<xsd:enumeration value=\"Polyline\"/>\r\n			<xsd:enumeration value=\"Polygon\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n\r\n        <xsd:simpleType name=\"vertBaseType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  vertBaseType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"Datum level\"></xsd:enumeration>\r\n			<xsd:enumeration value=\"Ground level\"></xsd:enumeration>\r\n			<xsd:enumeration value=\"Sea level\"></xsd:enumeration>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n\r\n        <xsd:simpleType name=\"verticalUnitsType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  verticalUnitsType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"centimeters (cm)\"/>\r\n			<xsd:enumeration value=\"meters (m)\"/>\r\n			<xsd:enumeration value=\"kilometers (km)\"/>\r\n			<xsd:enumeration value=\"inches (in)\"/>\r\n			<xsd:enumeration value=\"feet (ft)\"/>\r\n			<xsd:enumeration value=\"miles (mi)\"/>\r\n			<xsd:enumeration value=\"fathoms (fathoms)\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n        \r\n	<xsd:annotation>\r\n		<xsd:documentation>\r\n		**********************************************************************  Schema Overview  **************************************************************\r\n		This is an ADN CATEGORY schema used by both the ADN-item and ADN-collection metadata frameworks.\r\n		It defines global elements in both frameworks and common types across the CATEGORY schemas.		\r\n		\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>***********************  Other CATEGORY Schemas to Include  ********************************\r\n							There are no other framework schemas to include.\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>************************  VOCABULARY Schemas to Include  ***********************************</xsd:documentation>\r\n	</xsd:annotation>\r\n	\r\n	<xsd:annotation>\r\n		<xsd:documentation>************************  ROOT Element  **********************************************\r\n							There is no root element for this schema.\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>************************  GLOBAL Elements  (alpha order)  *******************************	\r\n				The individual FRAMEWORK schemas determine the minimum and maximum occurrences for these elements.\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:element name=\"description\" type=\"stringTextType\"/>\r\n	<xsd:element name=\"language\" type=\"xsd:language\"/>\r\n	<xsd:element name=\"name\" type=\"stringTextType\"/>\r\n	<xsd:element name=\"source\" type=\"stringTextType\"/>\r\n	<xsd:element name=\"sourceDesc\" type=\"stringTextType\"/>\r\n	<xsd:element name=\"title\" type=\"stringTextType\"/>\r\n	<xsd:annotation>\r\n		<xsd:documentation>************************  Complex Types  (alpha order) *****************************\r\n\r\n				catalogType						is part of catalogEntriesType\r\n				catalogEntriesType				used in general, metaMetadata and relation\r\n				IDandURLType 					used in many places\r\n				organizationType				used in lifecycle and metaMetadata\r\n				personType						used in lifecycle and metaMetadata\r\n\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:complexType name=\"catalogType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  catalogType  *********************************************************\r\n				entry					is an attribute\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"entry\" type=\"xsd:string\" use=\"required\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"catalogEntriesType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  catalogEntriesType  *****************************************************\r\n				These elements have the following types or schema associated with them.\r\n				catalog					is complex\r\n				\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:sequence>\r\n			<xsd:element name=\"catalog\" type=\"catalogType\" minOccurs=\"1\" maxOccurs=\"unbounded\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"IDandURLType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  IDandURLType  *************************************************\r\n				These elements have the following types or schema associated with them.\r\n				URL			is a an attribute string\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"URL\" type=\"stringTextType\" use=\"required\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"organizationType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				*******************************************  organizationType  ***************************************************\r\n				These elements have the following types or schema associated with them.\r\n				email					is a simple type\r\n				Note: xsd:string is used because transforms (particularly from DLESE-IMS to ADN) and the suppression of cataloger information may cause no content. But if the tag is required, then this null content must be allowed to happend. Therefore, use xsd:string (on the required elements except email) becuase it allows null compared to stringTextType.\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:all>\r\n			<xsd:element name=\"instName\" type=\"xsd:string\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"instDept\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"instPosition\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"instUrl\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"instEmail\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"contactID\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n		</xsd:all>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"personType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				*******************************************  personType  ***************************************************\r\n				These elements have the following types or schema associated with them.\r\n				nameTitle				is a simple type; see nameTitle.xsd\r\n				emailPrimary			is a simple type\r\n				emailAlt					is a simple type\r\n				Note: xsd:string is used because transforms (particularly from DLESE-IMS to ADN) and the suppression of cataloger information may cause no content. But if the tag is required, then this null content must be allowed to happend. Therefore, use xsd:string (on the required elements except email) becuase it allows null compared to stringTextType.\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:all>\r\n			<xsd:element name=\"nameTitle\" type=\"nameTitleType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"nameFirst\" type=\"xsd:string\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"nameMiddle\" type=\"xsd:string\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"nameLast\" type=\"xsd:string\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"instName\" type=\"xsd:string\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"instDept\" type=\"xsd:string\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"emailPrimary\" type=\"stringTextType\" minOccurs=\"1\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"emailAlt\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n			<xsd:element name=\"contactID\" type=\"stringTextType\" minOccurs=\"0\" maxOccurs=\"1\"/>\r\n		</xsd:all>\r\n	</xsd:complexType>\r\n	<xsd:annotation>\r\n		<xsd:documentation>***********************  Simple Types (alpha order) *************************************\r\n				emailType\r\n				stringTextType\r\n				union.dateType\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:simpleType name=\"emailType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>E-Mail address on the Internet (must be in name@company.net format) Both numbers and letters are allowed on either side of the @ sign.\r\n*********************** Not currently being used. But may be used in the future. *************************8\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:pattern value=\"[\\p{L}_-{\\d}]+(\\.[\\p{L}_-{\\d}]+)*@[\\p{L}_{\\d}]+(\\.[\\p{L}_{\\d}]+)+\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"stringTextType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n					Use this patterned string to ensure that a null tag is not valid string content.\r\n					Note: that xsd:string allows content to be null even if the element is required.\r\n					Note: xsd:string is used in person and organization because for some situations null may be needed.\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:pattern value=\".[\\S\\s]*\"/>\r\n<!--			<xsd:pattern value=\"(.)+\"/> does not allow carriage returns -->\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"union.dateType\">\r\n		<xsd:union memberTypes=\"xsd:date xsd:gYearMonth xsd:gYear dateType\"/>\r\n	</xsd:simpleType>\r\n\r\n        \r\n	<xsd:annotation>\r\n		<xsd:documentation>\r\n		**********************************************************************  Schema Overview  **************************************************************\r\n			Definition: 			Controlled vocabulary schema for DLESE metadata frameworks\r\n			Framework use: 		ADN-I (item)\r\n			Source org:			DLESE Program Center (DPC); http://www.dlese.org\r\n			Source values:		DPC\r\n			Source last update:	2002-10-31\r\n			DPC last update:		2002-10-31\r\n			Notes: 				Developed and maintained by the DPC.\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>************************  Complex Types  ******************************************</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>***********************  Simple Types (alpha order) *************************************</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:simpleType name=\"nameTitleType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  nameTitleType  *********************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"Dr\"/>\r\n			<xsd:enumeration value=\"Miss\"/>\r\n			<xsd:enumeration value=\"Mr\"/>\r\n			<xsd:enumeration value=\"Mrs\"/>\r\n			<xsd:enumeration value=\"Ms\"/>\r\n			<xsd:enumeration value=\"Prof\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n       \r\n	<xsd:annotation>\r\n		<xsd:documentation>\r\n		**********************************************************************  Overview  **************************************************************\r\n			Definition: 			Controlled vocabulary schema for DLESE metadata frameworks\r\n			Framework use: 		ADN-I (item)\r\n			Source org:			DLESE Program Center (DPC); http://www.dlese.org\r\n			Source values:		DPC\r\n			Source last update:	2003-06-11\r\n			DPC last update:		2003-06-11\r\n			Notes: 				Developed and maintained at the DPC.\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>***********************  Simple Types (alpha order) *************************************</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:simpleType name=\"dateType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>\r\n				***************************************  dateVocabType  *****************************************\r\n				Lists the values that will appear in the metadata record\r\n			</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"Present\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n\r\n\r\n        <xsd:element name=\"geospatialCoveragesMD\" type=\"geospatialCoveragesType\"/>\r\n\r\n</xsd:schema>\r\n','geospatialCoveragesMD','',''),
	(51,'MODS','3.2 without Related ','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<!-- edited with XML Spy v4.4 U (http://www.xmlspy.com) by Ray Denenberg  (Library of Congress) -->\r\n<xsd:schema xmlns:xlink=\"http://www.w3.org/1999/xlink\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" xmlns=\"http://www.loc.gov/mods/v3\" targetNamespace=\"http://www.loc.gov/mods/v3\" elementFormDefault=\"qualified\" attributeFormDefault=\"unqualified\">\r\n	<xsd:import namespace=\"http://www.w3.org/XML/1998/namespace\" schemaLocation=\"http://www.w3.org/2001/xml.xsd\"/>\r\n	<xsd:import namespace=\"http://www.w3.org/1999/xlink\" schemaLocation=\"http://www.loc.gov/standards/xlink.xsd\"/>\r\n	<!-- \r\n\r\nMODS 3.2\r\nJune 1, 2006	\r\n\r\n***************************  List of changes from 3.1:\r\n\r\n1. <location><url>\r\n1.1. Added attribute \"note\" to allow for notes associated with the link.  \r\n    Tentative plan for 4.0 is to make it an element instead of an attribute, \r\n    and  wrap <url> and <urlNote> together. Can\'t do that in 3.2 \r\n    because it would not be compatible with 3.1. \r\n1.2. Added attribute \"access\",  enumerated list with values:\r\npreview\r\nraw object\r\nobject in context\r\n1.3  Add attribute \'usage\' under <url> with one enumerated value: \"primary display\".\r\n\r\n2. <physicalDescription><digitalOrigin>\r\nAdded enumerated values: \r\ndigitized microfilm \r\ndigitized other analog \r\n\r\n3. <part>\r\n3.1. Added attributes ID, type, order \r\n3.2. <part> may now be empty (minOccurs 0 on choice)\r\n\r\n4. ID attribute added.\r\n4.1 to relatedItem\r\n4.2 to note.\r\n\r\n5. The following  elements have been globalized:\r\n5.1 <dateCaptured>  (under <originInfo>)  dateCapturedType defined\r\n5.2 <edition> (under <originInfo> editionType defined\r\n5.3 <physicalLocation> (under <location>) physicalLocationType defined\r\n\r\n6. Elements whose type had been assumed to be \"string\",\r\n    but had not been explicitly typed, are now typed. \r\n\r\n7.  Add  subelement <genre> under <subject>.\r\n\r\n8. The schema location reference for xlink is changed to \r\n    http://www.loc.gov/standards/xlink.xsd. \r\n   (It was previously http://www.loc.gov/standards/mods/xlink.xsd. \r\n   The schema now resides in both places so that earlier versions \r\n    will not be affected, but it is now intended that the new copy \r\n    be referenced, outside of the mods directory, \r\n   so that other projects, e.g. mets, may reference it.)\r\n\r\n\r\n********************** end list of changes from 3.1\r\n\r\n\r\n*****  An instance of this schema is \r\n\r\n (1) a single MODS record:  \r\n	 -->\r\n	<xsd:element name=\"mods\" type=\"modsType\"/>\r\n	<!--  \r\nor \r\n\r\n(2) a collection of MODS records:  -->\r\n	<xsd:element name=\"modsCollection\">\r\n		<xsd:complexType>\r\n			<xsd:sequence>\r\n				<xsd:element ref=\"mods\" maxOccurs=\"unbounded\"/>\r\n			</xsd:sequence>\r\n		</xsd:complexType>\r\n	</xsd:element>\r\n	<!--  \r\n\r\n*****  End of \"instance\" definition\r\n\r\n******* Group definition. Forms the basis of the mods \r\n     record definintion, and also relatedItem. \r\n   Difference is that mods requires at least one element \r\n   and relatedItem does not.\r\n\r\n-->\r\n	<xsd:group name=\"modsGroup\">\r\n		<xsd:choice>\r\n			<xsd:element name=\"titleInfo\" type=\"titleInfoType\"/>\r\n			<xsd:element name=\"name\" type=\"nameType\"/>\r\n			<xsd:element name=\"typeOfResource\" type=\"typeOfResourceType\"/>\r\n			<xsd:element name=\"genre\" type=\"genreType\"/>\r\n			<xsd:element name=\"originInfo\" type=\"originInfoType\"/>\r\n			<xsd:element name=\"language\" type=\"languageType\"/>\r\n			<xsd:element name=\"physicalDescription\" type=\"physicalDescriptionType\"/>\r\n			<xsd:element name=\"abstract\" type=\"abstractType\"/>\r\n			<xsd:element name=\"tableOfContents\" type=\"tableOfContentsType\"/>\r\n			<xsd:element name=\"targetAudience\" type=\"targetAudienceType\"/>\r\n			<xsd:element name=\"note\" type=\"noteType\"/>\r\n			<xsd:element name=\"subject\" type=\"subjectType\"/>\r\n			<xsd:element name=\"classification\" type=\"classificationType\"/>\r\n			<xsd:element name=\"relatedItem\" type=\"relatedItemType\"/>\r\n			<xsd:element name=\"identifier\" type=\"identifierType\"/>\r\n			<xsd:element name=\"location\" type=\"locationType\"/>\r\n			<xsd:element name=\"accessCondition\" type=\"accessConditionType\"/>\r\n			<xsd:element name=\"part\" type=\"partType\"/>\r\n			<xsd:element name=\"extension\" type=\"extensionType\"/>\r\n			<xsd:element name=\"recordInfo\" type=\"recordInfoType\"/>\r\n		</xsd:choice>\r\n	</xsd:group>\r\n	<!--\r\n*****  Definition of a single MODS record\r\n-->\r\n	<xsd:complexType name=\"modsType\">\r\n		<xsd:group ref=\"modsGroup\" maxOccurs=\"unbounded\"/>\r\n		<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\r\n		<xsd:attribute name=\"version\" type=\"versionType\"/>\r\n	</xsd:complexType>\r\n	<!--\r\n*****  End of definition of a MODS record.\r\n \r\n***** Data type definitions for top level elements follow\r\n\r\n ********** titleInfoType definition **********\r\n -->\r\n	<xsd:complexType name=\"titleInfoType\">\r\n		<xsd:complexContent>\r\n			<xsd:extension base=\"baseTitleInfoType\">\r\n				<xsd:attribute name=\"type\" use=\"optional\">\r\n					<xsd:simpleType>\r\n						<xsd:annotation>\r\n							<xsd:documentation>if this attribute is omitted, then title relates to 245$a  $b  $n  and $p</xsd:documentation>\r\n						</xsd:annotation>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"abbreviated\">\r\n								<xsd:annotation>\r\n									<xsd:documentation>210</xsd:documentation>\r\n								</xsd:annotation>\r\n							</xsd:enumeration>\r\n							<xsd:enumeration value=\"translated\">\r\n								<xsd:annotation>\r\n									<xsd:documentation>242</xsd:documentation>\r\n								</xsd:annotation>\r\n							</xsd:enumeration>\r\n							<xsd:enumeration value=\"alternative\">\r\n								<xsd:annotation>\r\n									<xsd:documentation>246</xsd:documentation>\r\n								</xsd:annotation>\r\n							</xsd:enumeration>\r\n							<xsd:enumeration value=\"uniform\">\r\n								<xsd:annotation>\r\n									<xsd:documentation>240, 130</xsd:documentation>\r\n								</xsd:annotation>\r\n							</xsd:enumeration>\r\n						</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n			</xsd:extension>\r\n		</xsd:complexContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"baseTitleInfoType\">\r\n		<xsd:choice minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n			<xsd:element name=\"title\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"subTitle\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"partNumber\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"partName\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"nonSort\" type=\"xsd:string\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>All characters, including space, up to the first sort character.</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n		</xsd:choice>\r\n		<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\r\n		<xsd:attributeGroup ref=\"xlink:simpleLink\"/>\r\n		<xsd:attributeGroup ref=\"language\"/>\r\n		<xsd:attribute name=\"authority\" type=\"xsd:string\" use=\"optional\"/>\r\n		<xsd:attribute name=\"displayLabel\" use=\"optional\" type=\"xsd:string\"/>\r\n	</xsd:complexType>\r\n	<!-- \r\n **********  nameType definition  **********   		\r\n-->\r\n	<xsd:complexType name=\"nameType\">\r\n		<xsd:choice minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n			<xsd:element name=\"namePart\" type=\"namePartType\"/>\r\n			<xsd:element name=\"displayForm\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>245$c</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"affiliation\" type=\"xsd:string\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>100, 700 $u</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"role\" type=\"roleType\"/>\r\n			<xsd:element name=\"description\" type=\"xsd:string\"/>\r\n		</xsd:choice>\r\n		<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\r\n		<xsd:attribute name=\"type\" type=\"nameTypeAttribute\" use=\"optional\"/>\r\n		<xsd:attribute name=\"authority\" use=\"optional\" type=\"xsd:string\">\r\n			<xsd:annotation>\r\n				<xsd:documentation>Value is from the list at  \r\n				http:/www.loc.gov/marc/sourcecode/authorityfile/authorityfilesource.html\r\n				</xsd:documentation>\r\n			</xsd:annotation>\r\n		</xsd:attribute>\r\n		<xsd:attributeGroup ref=\"xlink:simpleLink\"/>\r\n		<xsd:attributeGroup ref=\"language\"/>\r\n		<!--\r\n***** End declaration of elements for nameType.  \r\n\r\n***** Begin declaration of attributes for nameType.\r\n-->\r\n	</xsd:complexType>\r\n	<!--  \r\n***** Begin definition of subordinate types for nameType.\r\n-->\r\n	<xsd:complexType name=\"namePartType\">\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"ID\" use=\"optional\"/>\r\n				<xsd:attribute name=\"type\" use=\"optional\">\r\n					<xsd:simpleType>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"date\"/>\r\n							<xsd:enumeration value=\"family\"/>\r\n							<xsd:enumeration value=\"given\"/>\r\n							<xsd:enumeration value=\"termsOfAddress\"/>\r\n						</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n        <xsd:complexType name=\"publisherType\">\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"ID\" use=\"optional\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"roleType\">\r\n		<xsd:sequence maxOccurs=\"unbounded\">\r\n			<xsd:element name=\"roleTerm\">\r\n				<xsd:complexType>\r\n					<xsd:annotation>\r\n						<xsd:documentation>if it is a code: 100, 110, 111, 700, 710, 711 $4.\r\n					If it is text:100, 110, 700, 710 $e.		\r\n					</xsd:documentation>\r\n					</xsd:annotation>\r\n					<xsd:simpleContent>\r\n						<xsd:extension base=\"xsd:string\">\r\n							<xsd:attribute name=\"authority\" use=\"optional\" type=\"xsd:string\">\r\n								<xsd:annotation>\r\n									<xsd:documentation>The value of this attribute is from list at http://www.loc.gov/marc/sourcecode/relator/relatorsource.html.  If the value is \"marcrelator\" the content is from list at http://www.loc.gov/marc/sourcecode/relator/relatorlist.html\r\n </xsd:documentation>\r\n								</xsd:annotation>\r\n							</xsd:attribute>\r\n							<xsd:attribute name=\"type\" type=\"codeOrText\" use=\"optional\"/>\r\n						</xsd:extension>\r\n					</xsd:simpleContent>\r\n				</xsd:complexType>\r\n			</xsd:element>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n	<!--\r\n***** End definition of nameType.\r\n-->\r\n	<!--\r\n********** typeOfResourceType  definition **********   	  \r\n -->\r\n	<xsd:complexType name=\"typeOfResourceType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>LDR/6</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"resourceType\">\r\n				<xsd:attribute name=\"collection\" use=\"optional\">\r\n					<xsd:simpleType>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"yes\"/>\r\n						</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n				<xsd:attribute name=\"manuscript\" use=\"optional\">\r\n					<xsd:simpleType>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"yes\"/>\r\n						</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:simpleType name=\"resourceType\">\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"text\"/>\r\n			<xsd:enumeration value=\"cartographic\"/>\r\n			<xsd:enumeration value=\"notated music\"/>\r\n			<xsd:enumeration value=\"sound recording-musical\"/>\r\n			<xsd:enumeration value=\"sound recording-nonmusical\"/>\r\n			<xsd:enumeration value=\"sound recording\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>Use for mixed musical and nonmusical, or when not specified whether musical or nonmusical.\r\n</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:enumeration>\r\n			<xsd:enumeration value=\"still image\"/>\r\n			<xsd:enumeration value=\"moving image\"/>\r\n			<xsd:enumeration value=\"three dimensional object\"/>\r\n			<xsd:enumeration value=\"software, multimedia\"/>\r\n			<xsd:enumeration value=\"mixed material\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<!--  \r\n********** genreType defintion  **********  	\r\n-->\r\n	<xsd:complexType name=\"genreType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>008/26, 008/33, 008/29, 008/30,  008/24+, 008/21, 008/25, 655</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"type\" use=\"optional\" type=\"xsd:string\"/>\r\n				<xsd:attribute name=\"authority\" use=\"optional\" type=\"xsd:string\">\r\n					<xsd:annotation>\r\n						<xsd:documentation> Value of this attribute may be from the list at:http://www.loc.gov/marc/sourcecode/genre/genresource.html.  If so, and if  the value is \'marcgt\' then the content is from list at http://www.loc.gov/marc/sourcecode/genre/genrelist.html.  The value may instead be a uri. </xsd:documentation>\r\n					</xsd:annotation>\r\n				</xsd:attribute>\r\n				<xsd:attributeGroup ref=\"language\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!--  \r\n ********** originInfoType definition  ********** \r\n-->\r\n	<xsd:complexType name=\"originInfoType\">\r\n		<xsd:choice maxOccurs=\"unbounded\">\r\n			<xsd:element name=\"place\" type=\"placeType\"/>\r\n			<xsd:element name=\"publisher\" type=\"publisherType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>260 $b</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"dateIssued\" type=\"dateType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>260$c, 008/07-14</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"dateCreated\" type=\"dateType\"/>\r\n			<xsd:element name=\"dateCaptured\" type=\"dateCapturedType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>033</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"dateValid\" type=\"dateType\"/>\r\n			<xsd:element name=\"dateModified\" type=\"dateType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>date resource modified, not record modified</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"copyrightDate\" type=\"dateType\"/>\r\n			<xsd:element name=\"dateOther\" type=\"dateOtherType\"/>\r\n			<xsd:element name=\"edition\" type=\"editionType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>250</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"issuance\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>LDR/7</xsd:documentation>\r\n				</xsd:annotation>\r\n				<xsd:simpleType>\r\n					<xsd:restriction base=\"xsd:string\">\r\n						<xsd:enumeration value=\"continuing\"/>\r\n						<xsd:enumeration value=\"monographic\"/>\r\n					</xsd:restriction>\r\n				</xsd:simpleType>\r\n			</xsd:element>\r\n			<xsd:element name=\"frequency\" type=\"xsd:string\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>310</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n		</xsd:choice>\r\n		<xsd:attributeGroup ref=\"language\"/>\r\n	</xsd:complexType>\r\n	<!-- \r\n\r\n*****   Subordinate datatype for originInfo\r\n-->\r\n	<xsd:complexType name=\"placeType\">\r\n		<xsd:sequence>\r\n			<xsd:element name=\"placeTerm\" type=\"placeTermType\" maxOccurs=\"unbounded\"/>\r\n		