\"xlink:simpleLink\"/>\r\n	</xsd:complexType>\r\n	<!--\r\n********** identifierType definition  **********  	                     	\r\n-->\r\n	<xsd:complexType name=\"identifierType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>010, 020, 022, 024, 028, 037, 856</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"type\" use=\"optional\">\r\n					<xsd:annotation>\r\n						<xsd:documentation>Suggested values include (but are not limited to):  \"hdl\",\"doi\",\"isbn\", \"isrc\",  \"ismn\" \"issn\", \"issue number\", \"istc\",  \"lccn\",  \"local\", \"matrix number\", \"music publisher\", \"music plate\", \"sici\", \"uri\", \"upc\", \"videorecording identifier\", \"stock number\"</xsd:documentation>\r\n					</xsd:annotation>\r\n				</xsd:attribute>\r\n				<xsd:attribute name=\"displayLabel\" use=\"optional\" type=\"xsd:string\">\r\n					<xsd:annotation>\r\n						<xsd:documentation>856$3</xsd:documentation>\r\n					</xsd:annotation>\r\n				</xsd:attribute>\r\n				<xsd:attribute name=\"invalid\" use=\"optional\">\r\n					<xsd:annotation>\r\n						<xsd:documentation>$z in 0XX fields</xsd:documentation>\r\n					</xsd:annotation>\r\n					<xsd:simpleType>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"yes\"/>\r\n						</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n				<xsd:attributeGroup ref=\"language\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!--  	 \r\n********** locationType definition  **********  	                     	\r\n-->\r\n	<xsd:complexType name=\"locationType\">\r\n		<xsd:sequence>\r\n			<xsd:element name=\"physicalLocation\" type=\"physicalLocationType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element name=\"url\" type=\"urlType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n	<!--  \r\n********** urlType definition  (subordinate to locationType) **********              \r\n -->\r\n	<xsd:complexType name=\"urlType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>856$u</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:anyURI\">\r\n				<xsd:attribute name=\"dateLastAccessed\" use=\"optional\"/>\r\n				<xsd:attribute name=\"displayLabel\" use=\"optional\" type=\"xsd:string\">\r\n					<xsd:annotation>\r\n						<xsd:documentation>856$3</xsd:documentation>\r\n					</xsd:annotation>\r\n				</xsd:attribute>\r\n				<xsd:attribute name=\"note\" use=\"optional\" type=\"xsd:string\">\r\n					<xsd:annotation>\r\n						<xsd:documentation>856$z</xsd:documentation>\r\n					</xsd:annotation>\r\n				</xsd:attribute>\r\n				<xsd:attribute name=\"access\" use=\"optional\">\r\n					<xsd:simpleType>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"preview\"/>\r\n							<xsd:enumeration value=\"raw object\"/>\r\n							<xsd:enumeration value=\"object in context\"/>\r\n						</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n				<xsd:attribute name=\"usage\" use=\"optional\">\r\n					<xsd:simpleType>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"primary display\"/>\r\n													</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!--  \r\n  \r\n********** physicalLocationType definition  (subordinate to locationType) **********              \r\n -->\r\n	<xsd:complexType name=\"physicalLocationType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>852 $a $b $j $e</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"sourceType\">\r\n				<xsd:attribute name=\"type\" use=\"optional\" type=\"xsd:string\"/>\r\n				<xsd:attribute name=\"displayLabel\" use=\"optional\" type=\"xsd:string\">\r\n					<xsd:annotation>\r\n						<xsd:documentation>852$3</xsd:documentation>\r\n					</xsd:annotation>\r\n				</xsd:attribute>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!--\r\n********** accessConditionType definition  **********              \r\n -->\r\n	<xsd:complexType name=\"accessConditionType\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>506, 540</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"unstructuredText\"/>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!-- \r\n********** partType definition **********  \r\n-->\r\n	<xsd:complexType name=\"partType\">\r\n		<xsd:choice minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n			<!--minOccurs=\"0\" allows <part> to be optionally empty,   when the ID and type attribute values contain all the information needed about the part. -->\r\n			<xsd:element name=\"detail\" type=\"detailType\"/>\r\n			<xsd:element name=\"extent\" type=\"extentType\"/>\r\n			<xsd:element name=\"date\" type=\"baseDateType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>Use only if different from date of resource being described in \'originInfo\'</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"text\" type=\"unstructuredText\"/>\r\n		</xsd:choice>\r\n		<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\r\n		<xsd:attribute name=\"type\" type=\"xsd:string\" use=\"optional\"/>\r\n		<xsd:attribute name=\"order\" type=\"xsd:integer\" use=\"optional\"/>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"detailType\">\r\n		<xsd:choice maxOccurs=\"unbounded\">\r\n			<xsd:element name=\"number\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"caption\" type=\"xsd:string\"/>\r\n			<xsd:element name=\"title\" type=\"xsd:string\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>Use only if different than main title of resource being described</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n		</xsd:choice>\r\n		<xsd:attribute name=\"type\" use=\"optional\" type=\"xsd:string\">\r\n			<xsd:annotation>\r\n				<xsd:documentation>Suggested values: part, volume, issue, chapter, section, paragraph, track. These values are used regardless of linguistic term)</xsd:documentation>\r\n			</xsd:annotation>\r\n		</xsd:attribute>\r\n		<xsd:attribute name=\"level\" type=\"xsd:positiveInteger\" use=\"optional\">\r\n			<xsd:annotation>\r\n				<xsd:documentation>Hierarchical level (level of enumeration) of a given detail element when there are multiple detail elements;  top level is 1. For example assume two details, volume and  issue; for volume (which is at a higher level hierarchically):  type=\"volume\" level=\"1\"; for issue:  type=\"issue\" level=\"2\".\r\n</xsd:documentation>\r\n			</xsd:annotation>\r\n		</xsd:attribute>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"extentType\">\r\n		<xsd:sequence>\r\n			<xsd:annotation>\r\n				<xsd:documentation> If \'start\' but not \'end\'  is supplied, it should be assumed that the end page is unknown. A single page is indicated by presence of both \'start\' and \'end\' with same value. </xsd:documentation>\r\n			</xsd:annotation>\r\n			<xsd:element name=\"start\" minOccurs=\"0\" type=\"xsd:string\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>  Use for first page or begin minute</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"end\" minOccurs=\"0\" type=\"xsd:string\">\r\n				<xsd:annotation>\r\n					<xsd:documentation> Use for last page, end minutes, or (together with start element) single page</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"total\" type=\"xsd:positiveInteger\" minOccurs=\"0\">\r\n				<xsd:annotation>\r\n					<xsd:documentation> A cardinal rather than ordinal number. Use for a total number of pages or minutes. \r\n</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"list\" minOccurs=\"0\" type=\"xsd:string\">\r\n				<xsd:annotation>\r\n					<xsd:documentation> Use for an unparsed statement, e.g. p. 5-12. </xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n		</xsd:sequence>\r\n		<xsd:attribute name=\"unit\"  type=\"xsd:string\">\r\n			<xsd:annotation>\r\n				<xsd:documentation>  suggested values: pages, minutes</xsd:documentation>\r\n			</xsd:annotation>\r\n		</xsd:attribute>\r\n		\r\n	</xsd:complexType>\r\n	<!-- \r\n\r\n********** extensionType definition **********  \r\n-->\r\n	<xsd:complexType name=\"extensionType\" mixed=\"true\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>use for local extensions or for extensions from other XML schemas</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:sequence>\r\n			<xsd:any processContents=\"lax\" maxOccurs=\"unbounded\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n	<!--  \r\n**********  recordInfoType definition **********   \r\n-->\r\n	<xsd:complexType name=\"recordInfoType\">\r\n		<xsd:choice maxOccurs=\"unbounded\">\r\n			<xsd:element name=\"recordContentSource\" type=\"sourceType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>040 $a, $d</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"recordCreationDate\" type=\"dateType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>008/00-05</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"recordChangeDate\" type=\"dateType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>005</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:element>\r\n			<xsd:element name=\"recordIdentifier\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>001</xsd:documentation>\r\n				</xsd:annotation>\r\n				<xsd:complexType>\r\n					<xsd:simpleContent>\r\n						<xsd:extension base=\"xsd:string\">\r\n							<xsd:attribute name=\"source\" use=\"optional\" type=\"xsd:string\">\r\n								<xsd:annotation>\r\n									<xsd:documentation>Who supplied the identifier. From 003</xsd:documentation>\r\n								</xsd:annotation>\r\n							</xsd:attribute>\r\n						</xsd:extension>\r\n					</xsd:simpleContent>\r\n				</xsd:complexType>\r\n			</xsd:element>\r\n			<xsd:element name=\"languageOfCataloging\" type=\"languageType\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>040$b</xsd:documentation>\r\n				</xsd:annotation>\r\n				<!-- This applies to the record at large. Any top level element can indicate a language, which overides this value for that element. -->\r\n			</xsd:element>\r\n			<xsd:element name=\"recordOrigin\" type=\"xsd:string\"/>\r\n		</xsd:choice>\r\n		<xsd:attributeGroup ref=\"language\"/>\r\n		<!-- This applies to the language of RecordInfo only. I.e. for recordContentSource and for source of identifier. -->\r\n	</xsd:complexType>\r\n	<!--  \r\n***** End  data type definitions for top level elements.  \r\n\r\n***** Begin global definitions. \r\n-->\r\n	<!--\r\n********** unstructuredText Definition  ********** \r\n-->\r\n	<xsd:complexType name=\"unstructuredText\">\r\n		<xsd:annotation>\r\n			<xsd:documentation>If the link  is supplied it is in lieu of or in addition to the content.</xsd:documentation>\r\n		</xsd:annotation>\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attributeGroup ref=\"xlink:simpleLink\"/>\r\n				<xsd:attributeGroup ref=\"language\"/>\r\n				<xsd:attribute name=\"displayLabel\" use=\"optional\" type=\"xsd:string\"/>\r\n				<xsd:attribute name=\"type\" type=\"xsd:string\" use=\"optional\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!--  \r\n********** dateType definition  **********  \r\n-->\r\n	<xsd:complexType name=\"baseDateType\">\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"encoding\" use=\"optional\">\r\n					<xsd:annotation>\r\n						<xsd:documentation>if omitted, free text is assumed</xsd:documentation>\r\n					</xsd:annotation>\r\n					<xsd:simpleType>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"w3cdtf\"/>\r\n							<xsd:enumeration value=\"iso8601\"/>\r\n							<xsd:enumeration value=\"marc\"/>\r\n						</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n				<xsd:attribute name=\"qualifier\" use=\"optional\">\r\n					<xsd:simpleType>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"approximate\"/>\r\n							<xsd:enumeration value=\"inferred\"/>\r\n							<xsd:enumeration value=\"questionable\"/>\r\n						</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n				<xsd:attribute name=\"point\" use=\"optional\">\r\n					<xsd:simpleType>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"start\"/>\r\n							<xsd:enumeration value=\"end\"/>\r\n						</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"dateType\">\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"baseDateType\">\r\n				<xsd:attribute name=\"keyDate\" use=\"optional\">\r\n					<xsd:simpleType>\r\n						<xsd:annotation>\r\n							<xsd:documentation>So that a particular date may be distinguished among several dates. Thus for example when sorting MODS records by date, a date with keyDate=\"yes\" would be the date to sort on. It should occur only for one date at most in a given record.</xsd:documentation>\r\n						</xsd:annotation>\r\n						<xsd:restriction base=\"xsd:string\">\r\n							<xsd:enumeration value=\"yes\"/>\r\n						</xsd:restriction>\r\n					</xsd:simpleType>\r\n				</xsd:attribute>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<xsd:complexType name=\"dateOtherType\">\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"dateType\">\r\n				<xsd:attribute name=\"type\" use=\"optional\" type=\"xsd:string\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!--  \r\n********** sourceType definition  **********  	                       	  \r\n-->\r\n	<xsd:complexType name=\"sourceType\">\r\n		<xsd:simpleContent>\r\n			<xsd:extension base=\"xsd:string\">\r\n				<xsd:attribute name=\"authority\" use=\"optional\" type=\"xsd:string\">\r\n					<xsd:annotation>\r\n						<xsd:documentation>Value of this attribute is from list at: http://www.loc.gov/marc/sourcecode/organization/organizationsource.html.  If the value is \"marcorg\", see: http://www.loc.gov/marc/organizations</xsd:documentation>\r\n					</xsd:annotation>\r\n				</xsd:attribute>\r\n				<xsd:attributeGroup ref=\"language\"/>\r\n			</xsd:extension>\r\n		</xsd:simpleContent>\r\n	</xsd:complexType>\r\n	<!--  \r\n ********** language attribute group definition  **********  	                       	  \r\n-->\r\n	<xsd:attributeGroup name=\"language\">\r\n		<xsd:attribute name=\"lang\" use=\"optional\" type=\"xsd:string\">\r\n			<xsd:annotation>\r\n				<xsd:documentation>ISO 639-2b</xsd:documentation>\r\n			</xsd:annotation>\r\n		</xsd:attribute>\r\n		<xsd:attribute ref=\"xml:lang\" use=\"optional\"/>\r\n		<xsd:attribute name=\"script\" use=\"optional\" type=\"xsd:string\"/>\r\n		<xsd:attribute name=\"transliteration\" use=\"optional\" type=\"xsd:string\"/>\r\n	</xsd:attributeGroup>\r\n	<!--  \r\n   ********** definition of codeOrText type used by type attribute \r\n   for elements that distinguish code from text  **********  	                       	  \r\n -->\r\n	<xsd:simpleType name=\"codeOrText\">\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"code\"/>\r\n			<xsd:enumeration value=\"text\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<!--  \r\n    ********** definition of placeAuthority type used by authority attribute\r\n      for  placeType and geographic  **********  	                       	  \r\n -->\r\n	<xsd:simpleType name=\"placeAuthority\">\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"marcgac\"/>\r\n			<xsd:enumeration value=\"marccountry\"/>\r\n			<xsd:enumeration value=\"iso3166\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<!--  \r\n    ********** definition of nameTypeAttribute used by name attribute\r\n      \"type\"  **********  	                       	  \r\n -->\r\n	<xsd:simpleType name=\"nameTypeAttribute\">\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"personal\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>100, 700</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:enumeration>\r\n			<xsd:enumeration value=\"corporate\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>110, 710.</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:enumeration>\r\n			<xsd:enumeration value=\"conference\">\r\n				<xsd:annotation>\r\n					<xsd:documentation>111, 711</xsd:documentation>\r\n				</xsd:annotation>\r\n			</xsd:enumeration>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n	<xsd:simpleType name=\"versionType\">\r\n		<xsd:restriction base=\"xsd:string\">\r\n			<xsd:enumeration value=\"3.2\"/>\r\n		</xsd:restriction>\r\n	</xsd:simpleType>\r\n</xsd:schema>','mods','mods',''),
	(52,'AudioMD','1.0','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<!-- edited with XML Spy v4.0.1 (http://www.xmlspy.com) by D. Casey (User Technology Associates, Inc.) -->\r\n<xs:schema targetNamespace=\"http://www.loc.gov/AMD/\" xmlns:xs=\"http://www.w3.org/2001/XMLSchema\" xmlns=\"http://www.loc.gov/AMD/\" elementFormDefault=\"qualified\">\r\n	<!--============================================================\r\n\r\n  AUDIOMD: Audio Technical Metadata Extension Schema  \r\n  Initial Version:  AMD_020322.xsd (obtained from Carl\'s webpage on 03/27/2002)\r\n\r\n  Changes 03/27/2002:\r\n  DKC- Removed duplicate elements \"note\" and \"num_channels\" from the \r\n        complexType node \"physical_dataType\".\r\n     - Removed \"calibration\" from \"file_data\" due to its inclusion in \r\n        \"calibration_info\".\r\n     - Removed \"duration\" from \"physical_data\" due to its inclusion in \r\n        \"time_info\".\r\n  Changes 04/03/2002:\r\n  DKC- Duplicated the AUDIOMD node to create the AUDIOSRC node.  Removed \r\n        \"physical_data\" from AUDIOMD and \"file_data\" from AUDIOSRC.\r\n     - Created a \"audio_info\" node and moved the following nodes into it: note, \r\n        num_channels, sound_field, sound_channel_map, duration\r\n  Changes 07/25/2002\r\n  DKC- Abstracted the root element in order to provide support for both analog \r\n        and digital sources.\r\n     - Simplified the structure to eliminate the unecessary element references \r\n        and complex types.\r\n  Changes 08/22/2002\r\n  DKC- Cleaned up much of the documentation and definitions.  This should \r\n        continue.\r\n  \r\n============================================================ -->\r\n	<xs:element name=\"AUDIOMD\" type=\"audioType\"/>\r\n	<xs:element name=\"AUDIOSRC\" type=\"audioType\"/>\r\n	<xs:element name=\"file_data\" type=\"file_dataType\"/>\r\n	<xs:element name=\"physical_data\" type=\"physical_dataType\"/>\r\n	<xs:element name=\"audio_info\" type=\"audio_infoType\"/>\r\n	<xs:element name=\"calibration_info\" type=\"calibrationType\"/>\r\n	<xs:annotation>\r\n		<xs:documentation>AMD: LC-AV Audio Metadata Extension Schema.\r\n			AMD contains technical metadata that describes either a digital file or a physical source object.  It is \r\n			based upon metadata elements developed by both LC and AES.  AMD is an interim schema being used \r\n			until a final extension schema is adopted.  AUDIOMD and AUDIOSRC both complex types named \"audioType\" \r\n			and contain 4 top-level elements and 2 attributes,\r\n		        	ID: (XML ID)\r\n        			ANALOGDIGITALFLAG:  A major indicator of the type of audio object i.e Analog, PhysDigital, or FileDigital.\r\n    </xs:documentation>\r\n	</xs:annotation>\r\n	<xs:complexType name=\"audioType\">\r\n		<xs:annotation>\r\n			<xs:documentation>audioType: complexType for encapsulating and organizing within a singleparent element \r\n				the individual audio metadata elements that describe an object or portion of an object.  The four individual \r\n				elements that comprise an audio object are documented under their corresponding types.</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:sequence>\r\n			<xs:element name=\"file_data\" type=\"file_dataType\" minOccurs=\"0\"/>\r\n			<xs:element name=\"physical_data\" type=\"physical_dataType\" minOccurs=\"0\"/>\r\n			<xs:element name=\"audio_info\" type=\"audio_infoType\" minOccurs=\"0\"/>\r\n			<xs:element name=\"calibration_info\" type=\"calibrationType\" minOccurs=\"0\"/>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"ID\" type=\"xs:ID\"/>\r\n		<xs:attribute name=\"ANALOGDIGITALFLAG\" use=\"required\">\r\n			<xs:simpleType>\r\n				<xs:restriction base=\"xs:NMTOKEN\">\r\n					<xs:enumeration value=\"Analog\"/>\r\n					<xs:enumeration value=\"PhysDigital\"/>\r\n					<xs:enumeration value=\"FileDigital\"/>\r\n				</xs:restriction>\r\n			</xs:simpleType>\r\n		</xs:attribute>\r\n	</xs:complexType>\r\n	<xs:complexType name=\"file_dataType\">\r\n		<xs:annotation>\r\n			<xs:documentation>file_data: The file_data element is used to describe technical characteristics of an audio \r\n				file.</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:sequence>\r\n			<xs:element name=\"audio_block_size\" type=\"xs:int\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>audio_block_size: This is the simple element which provides a place to store the \r\n						size of an audio block (frame or sample) in bytes.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"audio_data_encoding\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>audio_data_encoding: This is the simple element which provides a place to store \r\n						the encoding scheme of audio data,  e.g., pulse code modulation (PCM).</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"bits_per_sample\" type=\"xs:int\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>bits_per_sample: This is the simple element which provides a place to store the \r\n						size of a single digital audio sample in bits.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"byte_order\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>byte_order: This is the simple element which provides a place to store the order \r\n						of bit significance in a byte from left to right.  i.e. 0-least-to-most, 1-most-to-least.</xs:documentation>\r\n				</xs:annotation>\r\n				<xs:simpleType>\r\n					<xs:restriction base=\"xs:int\">\r\n						<xs:enumeration value=\"0\"/>\r\n						<xs:enumeration value=\"1\"/>\r\n					</xs:restriction>\r\n				</xs:simpleType>\r\n			</xs:element>\r\n			<xs:element name=\"checksum\" type=\"checksumType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xs:element name=\"compression\" type=\"compressionType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xs:element name=\"data_rate\" type=\"xs:int\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>data-_rate: This is the simple element which provides a place to store the data rate \r\n						(e.g. 1.5 Mbps, 4Mbps, etc...) of a digital audio file.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"data_rate_mode\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>data_rate_mode: This is the simple element which provides a place to store the data \r\n						rate mode of the audio file, e.g., fixed or variable.</xs:documentation>\r\n				</xs:annotation>\r\n				<xs:simpleType>\r\n					<xs:restriction base=\"xs:string\">\r\n						<xs:enumeration value=\"Fixed\"/>\r\n						<xs:enumeration value=\"Variable\"/>\r\n					</xs:restriction>\r\n				</xs:simpleType>\r\n			</xs:element>\r\n			<xs:element name=\"first_sample_offset\" type=\"xs:int\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>first_sample_offset: This is the simple element which provides a place to store the \r\n						location of the first valid sound sample in the file.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"first_valid_byte_block\" type=\"xs:int\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>first_valid_byte_block: This is the simple element which provides a place to store \r\n						the location of the first valid sound byte in the block.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"format_name\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>format_name: This is the simple element which provides a place to store the official \r\n						name for the file format taken from the format documentation,  e.g.  \"Broadcast Wave Format\" or \r\n						\"Raw\".</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"format_note\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>format_note: This is the simple element which provides a place to store application \r\n						specific information about the audio file.  e.g. SoundForge 5.0, WaveLab 3.0, etc....</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"format_version\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>format_version: This is the simple element which provides a place to store the version \r\n						of the audio format specified in format_name e.g. for format_name=\"Broadcast Wave Format\" \r\n						format_version=\"3.0\".</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"last_valid_byte_block\" type=\"xs:int\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>last_valid_byte_block: This is the simple element which provides a place to store the \r\n						location of the last valid sound byte in the block.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"num_sample_frames\" type=\"xs:int\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>num_sample_frames: This is the simple element which provides a place to store the \r\n						sample point value for a frame in the audio file.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"sampling_frequency\" type=\"xs:float\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>sampling_frequency: This is the simple element which provides a place to store the \r\n						sampling frequency of a digital audio file.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"security\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>security: This is the simple element which provides a place to store the type of \r\n						security precautions applied to the file e.g. password, encryption, hidden, etc.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"use\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>use: This is the simple element which provides a place to store the use of a digital \r\n						audio file, e.g., Master, Service High, Service Low, Preview.</xs:documentation>\r\n				</xs:annotation>\r\n				<xs:simpleType>\r\n					<xs:restriction base=\"xs:string\">\r\n						<xs:enumeration value=\"Master\"/>\r\n						<xs:enumeration value=\"Service\"/>\r\n						<xs:enumeration value=\"Service_High\"/>\r\n						<xs:enumeration value=\"Service_Low\"/>\r\n						<xs:enumeration value=\"Preview\"/>\r\n					</xs:restriction>\r\n				</xs:simpleType>\r\n			</xs:element>\r\n			<xs:element name=\"word_size\" type=\"xs:int\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>word_size: This is the simple element which provides a place to store the numberof \r\n						bytes that comprise a single sample of audio data; may be greater than actual significant sample size \r\n						expressed in bits.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"ID\" type=\"xs:ID\"/>\r\n	</xs:complexType>\r\n	<xs:complexType name=\"physical_dataType\">\r\n		<xs:annotation>\r\n			<xs:documentation>physical_data: The physical_data element describes the physical nature of an audio object if \r\n				it exists as such (i.e. it is not a file).  This will generally apply to analog items but may also be used to describe \r\n				digital formats such as open reel digital, DAT, ADAT tape, CD-R, etc....</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:sequence>\r\n			<xs:element name=\"condition\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>condition: This is the simple element which provides a place to store the physical \r\n						condition of an audio item.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"dimensions\" type=\"dimensionsType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xs:element name=\"disposition\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>disposition: This is the simple element which provides a place to store what became \r\n						of an audio source item.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"equalization\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>equalization:This is the simple element which provides a place to store the \r\n						equalization specifications or characteristics of an audio source item.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"generation\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>generation: This is the simple element which provides a place to store the generation \r\n						of an audio source item.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"groove\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>groove: This is the simple element which provides a place to store the type of disc \r\n						groove of an audio source item.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"material\" type=\"materialType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xs:element name=\"noise_reduction\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>noise_reduction: This is the simple element which provides a place to store the type \r\n						of noise reduction used in an audio source item, if any.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"phys_format\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>phys_format: This is the simple element which provides a place to store the \r\n						physical format of the audio item.  e.g. reel-to-reel tape, 1/4 inch cassette, etc...</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"speed\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>speed: This is the simple element which provides a place to store the nominal \r\n						playback speed of an audio source item.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"speed_adjustment\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>speed_adjustment: This is the simple element which provides a place to store the \r\n						speed adjustment required to playback an audio source item at its nominal speed.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"speed_note\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>speed_note: This is the simple element which provides a place to store the \r\n						miscellaneous information about the speed of an audio source item.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"track_format\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>track_format: This is the simple element which provides a place to store the track \r\n						format of an audio source item.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"tracking\" type=\"trackingType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"ID\" type=\"xs:ID\"/>\r\n	</xs:complexType>\r\n	<xs:complexType name=\"audio_infoType\">\r\n		<xs:annotation>\r\n			<xs:documentation>audio_info: The audio_info element is used to describe audio characteristics of an object \r\n				that not specific to either the physical object or a digital representation.</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:sequence>\r\n			<xs:element name=\"duration\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>duration: This is the simple element which provides a place to store the \r\n						duration of a digital audio file.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"note\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>note: This is the simple element which provides a place to store miscellaneous \r\n						information about the audio item.  e.g. digital alterations or enhancements to improve \r\n						quality.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"num_channels\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>num_channels: This is the simple element which provides a place to store the \r\n						number of channels of audio in the audio item.  e.g. 1, 2, 5, 6, etc...</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n			<xs:element name=\"sound_channel_map\" type=\"sound_channel_mapType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xs:element name=\"sound_field\" type=\"xs:string\" minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:annotation>\r\n					<xs:documentation>sound_field: This is the simple element which provides a place to store the \r\n						aural space of the item or portion of an item.</xs:documentation>\r\n				</xs:annotation>\r\n			</xs:element>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"ID\" type=\"xs:ID\"/>\r\n	</xs:complexType>\r\n	<xs:complexType name=\"calibrationType\">\r\n		<xs:annotation>\r\n			<xs:documentation>calibrationType: complexType for storing the type of calibration related characteristics of \r\n				an audio object, regardless of physical or digital format.\r\n				calibrationType has 1 attribute and 4 elements. \r\n	       	 		ID: (XML ID) \r\n       	 			- calibration_ext_int: indicates whether the calibration data is within digital audio file or in a separate file; \r\n		        		- calibration_location: the location of the calibration file if it is external  e.g. URN, URL, etc...; \r\n        				- calibration_time_stamp: the start time of the calibration file if it is internal  i.e. HH:MM:SSss...;\r\n		        		- calibration_type: defines the type of calibration data.\r\n			</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:sequence>\r\n			<xs:element name=\"calibration_ext_int\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"calibration_location\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"calibration_time_stamp\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"calibration_track_type\" type=\"xs:string\" minOccurs=\"0\"/>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"ID\" type=\"xs:ID\"/>\r\n	</xs:complexType>\r\n	<xs:complexType name=\"checksumType\">\r\n		<xs:annotation>\r\n			<xs:documentation>checksumType: complexType for recording the type of checksum used for a digital audio file.  \r\n				In most cases, this will be an md5 checksum as this is the only checksum allowed within the METS schema.\r\n				checksumType has 1 attribute and 3 elements. \r\n		        		ID: (XML ID) \r\n        				- checksum_datetime: datetime the checksum was calculated and applied; \r\n		        		- checksum_type: the type of checksum used;\r\n        				- checksum_value: the checksum value.\r\n      		</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:sequence>\r\n			<xs:element name=\"checksum_datetime\" type=\"xs:dateTime\" minOccurs=\"0\"/>\r\n			<xs:element name=\"checksum_type\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"checksum_value\" type=\"xs:string\" minOccurs=\"0\"/>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"ID\" type=\"xs:ID\"/>\r\n	</xs:complexType>\r\n	<xs:complexType name=\"compressionType\">\r\n		<xs:annotation>\r\n			<xs:documentation>compressionType: complexType for recording the type of compression used for a digital \r\n			audio file.\r\n			compressionType has 1 attribute and 3 elements. \r\n	        		ID: (XML ID) \r\n       	 		- codec_creator_app: name of the creator of the compression application e.g. SoundForge, etc...; \r\n        			- codec_creator_app_version: version of the compression application  e.g. 5.0, etc...; \r\n        			- codec_name: the name of the compression algorithm used e.g. Fraunhofer, Huffman, etc..;\r\n	        		- codec_quality: impact of the  compression on quality  e.g. lossless or lossy.\r\n      		</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:sequence>\r\n			<xs:element name=\"codec_creator_app\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"codec_creator_app_version\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"codec_name\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"codec_quality\" minOccurs=\"0\">\r\n				<xs:simpleType>\r\n					<xs:restriction base=\"xs:NMTOKEN\">\r\n						<xs:enumeration value=\"lossless\"/>\r\n						<xs:enumeration value=\"lossy\"/>\r\n					</xs:restriction>\r\n				</xs:simpleType>\r\n			</xs:element>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"ID\" type=\"xs:ID\"/>\r\n	</xs:complexType>\r\n	<xs:complexType name=\"dimensionsType\">\r\n		<xs:annotation>\r\n			<xs:documentation>dimensionsType: Complex Type for recording the dimensions of an object. \r\n			dimensionsType has the following attributes:\r\n	        		1. DEPTH: the depth as a floating point number;\r\n       	 		2. DIAMETER: The diameter of a circular item as a floating point number;\r\n        			3. GAUGE: The width of the medium unwound (e.g. tape);\r\n        			4. HEIGHT: The height as a floating point number;\r\n	        		5. LENGTH: The length of the medium unwound (e.g. tape);\r\n       	 		6. NOTE: Miscellaneous information about the dimensions;\r\n        			7. THICKNESS: the thickness of the medium unwound (e.g. tape);\r\n	        		8. UNITS: the unit of measurement;\r\n       	 		9. WIDTH: the width as a floating point number.\r\n			</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:attribute name=\"DEPTH\" type=\"xs:float\"/>\r\n		<xs:attribute name=\"DIAMETER\" type=\"xs:float\"/>\r\n		<xs:attribute name=\"GAUGE\" type=\"xs:string\"/>\r\n		<xs:attribute name=\"HEIGHT\" type=\"xs:float\"/>\r\n		<xs:attribute name=\"LENGTH\" type=\"xs:string\"/>\r\n		<xs:attribute name=\"NOTE\" type=\"xs:string\"/>\r\n		<xs:attribute name=\"THICKNESS\" type=\"xs:string\"/>\r\n		<xs:attribute name=\"UNITS\" type=\"xs:string\"/>\r\n		<xs:attribute name=\"WIDTH\" type=\"xs:float\"/>\r\n	</xs:complexType>\r\n	<xs:complexType name=\"materialType\">\r\n		<xs:annotation>\r\n			<xs:documentation>materialType: Complex Type for recording the physical characteristics of the construction and \r\n				material of an audio source item.\r\n				materialType has 1 attribute and 6 elements. \r\n		        		ID: (XML ID)\r\n       		 		- base_material: type of material used in the recording carrier  e.g plastic, glass, vinyl, mylar, etc...\r\n        				- binder: type of adhesive used to bind the recording surface to the substrate \r\n		        		- disc_surface: the type of recording surface aluminium, celluloid etc..\r\n        				- oxide: type of oxide used on the recording surface,  e.g. cobalt, chromium dioxide, ferrous oxide\r\n		        		- reflective_layer: type of material used on the recording surface, e.g. dye, tellurium-selenium alloy, etc..\r\n        				- stock_brand: name of the manufacturer of the recording medium, e.g. Scotch, Maxell, Sony, etc...\r\n      		</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:sequence>\r\n			<xs:element name=\"base_material\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"binder\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"disc_surface\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"oxide\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"reflective_layer\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"stock_brand\" type=\"xs:string\" minOccurs=\"0\"/>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"ID\" type=\"xs:ID\"/>\r\n	</xs:complexType>\r\n	<xs:complexType name=\"sound_channel_mapType\">\r\n		<xs:annotation>\r\n			<xs:documentation>sound_channel_mapType:  Complex type for describing the aural layout of any audio tracks.  \r\n				The sound_channel_map element is used to wrap any number of channel_assignment elements.  This \r\n				structure is used to describe the relationship of sound channels to their destination.  Generally, the destination \r\n				will be a location on the sound stage though it could also be something more specialized such as a time code \r\n				reader or even the channels of a mixing board.  The channel_assignment element maps a sound channel to \r\n				its destination.  There are 2 required attributes. The channe_num identifies the sound channel of this audio \r\n				object. Note that the first channel_num is 0 while each subsequent channel is incremented by 1.  \r\n				The map_location attribute specifies the destination.</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:sequence>\r\n			<xs:element name=\"channel_assignment\" minOccurs=\"0\">\r\n				<xs:complexType>\r\n					<xs:attribute name=\"CHANNELNUM\" type=\"xs:nonNegativeInteger\"/>\r\n					<xs:attribute name=\"MAPLOCATION\" type=\"xs:string\"/>\r\n				</xs:complexType>\r\n			</xs:element>\r\n		</xs:sequence>\r\n	</xs:complexType>\r\n	<xs:complexType name=\"trackingType\">\r\n		<xs:annotation>\r\n			<xs:documentation>trackingType: Complex Type for recording tracking information about an audio source item.  \r\n			trackingType has 1 attribute and 2 elements. \r\n        			ID: (XML ID) \r\n				- tracking_type: The type of tracking code, e.g., MAVIS number, actual shelf numbers, bar-code, etc.;\r\n	        		- tracking_value: Shelf number or other identifier for source, e.g., MAVIS number, actual shelf numbers, etc..\r\n      		</xs:documentation>\r\n		</xs:annotation>\r\n		<xs:sequence>\r\n			<xs:element name=\"tracking_type\" type=\"xs:string\" minOccurs=\"0\"/>\r\n			<xs:element name=\"tracking_value\" type=\"xs:string\" minOccurs=\"0\"/>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"ID\" type=\"xs:ID\"/>\r\n	</xs:complexType>\r\n</xs:schema>\r\n','AUDIOMD','',''),
	(53,'DesignMD','1.0','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<xsd:schema xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" elementFormDefault=\"qualified\" attributeFormDefault=\"unqualified\">\r\n	<!--============================================================\r\n\r\n	 DesignMD: Fez Metadata Extension Schema for Architectural Designs\r\n		\r\n	============================================================-->\r\n	<xsd:element name=\"DesignMD\" type=\"DesignMDType\"/>\r\n	<xsd:element name=\"research_program\" />        \r\n	<xsd:element name=\"submitting_author\" />        \r\n	<xsd:element name=\"design_location\" />        \r\n	<xsd:element name=\"project_team\" />        \r\n	<xsd:element name=\"consultant\" />        \r\n	<xsd:element name=\"date_of_completion\" />        \r\n	<xsd:complexType name=\"DesignMDType\">\r\n		<xsd:sequence>\r\n			<xsd:element ref=\"research_program\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"submitting_author\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"design_location\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"project_team\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"consultant\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"date_of_completion\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n</xsd:schema>\r\n','DesignMD','',''),
	(54,'MARCXML','1.1','<?xml version=\"1.0\"?>\r\n<xsd:schema targetNamespace=\"http://www.loc.gov/MARC21/slim\" xmlns=\"http://www.loc.gov/MARC21/slim\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" elementFormDefault=\"qualified\" attributeFormDefault=\"unqualified\" version=\"1.1\" xml:lang=\"en\">\r\n  <xsd:annotation>\r\n    <xsd:documentation>\r\n			MARCXML: The MARC 21 XML Schema\r\n			Prepared by Corey Keith\r\n\r\n                    August 4, 2003 - Version 1.1 - Removed import of xml namespace and the use of xml:space=\"preserve\" attributes on the leader and controlfields. \r\n                    Whitespace preservation in these subfields is accomplished by the use of xsd:whiteSpace value=\"preserve\"\r\n\r\n			May 21, 2002 - Version 1.0  - Initial Release\r\n\r\n			This schema supports XML markup of MARC21 records as specified in the MARC documentation (see www.loc.gov).  It allows tags with\r\n			alphabetics and subfield codes that are symbols, neither of which are as yet used in  the MARC 21 communications formats, but are \r\n			allowed by MARC 21 for local data.  The schema accommodates all types of MARC 21 records: bibliographic, holdings, bibliographic \r\n			with embedded holdings, authority, classification, and community information.\r\n		</xsd:documentation>\r\n  </xsd:annotation>\r\n  <xsd:element name=\"record\" type=\"recordType\" nillable=\"true\" id=\"record.e\">\r\n    <xsd:annotation>\r\n      <xsd:documentation>record is a top level container element for all of the field elements which compose the record</xsd:documentation>\r\n    </xsd:annotation>\r\n  </xsd:element>\r\n  <xsd:element name=\"collection\" type=\"collectionType\" nillable=\"true\" id=\"collection.e\">\r\n    <xsd:annotation>\r\n      <xsd:documentation>collection is a top level container element for 0 or many records</xsd:documentation>\r\n    </xsd:annotation>\r\n  </xsd:element>\r\n  <xsd:complexType name=\"collectionType\" id=\"collection.ct\">\r\n    <xsd:sequence minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n      <xsd:element ref=\"record\"/>\r\n    </xsd:sequence>\r\n    <xsd:attribute name=\"id\" type=\"idDataType\" use=\"optional\"/>\r\n  </xsd:complexType>\r\n  <xsd:complexType name=\"recordType\" id=\"record.ct\">\r\n    <xsd:sequence minOccurs=\"0\">\r\n      <xsd:element name=\"leader\" type=\"leaderFieldType\"/>\r\n      <xsd:element name=\"controlfield\" type=\"controlFieldType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n      <xsd:element name=\"datafield\" type=\"dataFieldType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n    </xsd:sequence>\r\n    <xsd:attribute name=\"type\" type=\"recordTypeType\" use=\"optional\"/>\r\n    <xsd:attribute name=\"id\" type=\"idDataType\" use=\"optional\"/>\r\n  </xsd:complexType>\r\n  <xsd:simpleType name=\"recordTypeType\" id=\"type.st\">\r\n    <xsd:restriction base=\"xsd:NMTOKEN\">\r\n      <xsd:enumeration value=\"Bibliographic\"/>\r\n      <xsd:enumeration value=\"Authority\"/>\r\n      <xsd:enumeration value=\"Holdings\"/>\r\n      <xsd:enumeration value=\"Classification\"/>\r\n      <xsd:enumeration value=\"Community\"/>\r\n    </xsd:restriction>\r\n  </xsd:simpleType>\r\n  <xsd:complexType name=\"leaderFieldType\" id=\"leader.ct\">\r\n    <xsd:annotation>\r\n      <xsd:documentation>MARC21 Leader, 24 bytes</xsd:documentation>\r\n    </xsd:annotation>\r\n    <xsd:simpleContent>\r\n      <xsd:extension base=\"leaderDataType\">\r\n        <xsd:attribute name=\"id\" type=\"idDataType\" use=\"optional\"/>\r\n      </xsd:extension>\r\n    </xsd:simpleContent>\r\n  </xsd:complexType>\r\n  <xsd:simpleType name=\"leaderDataType\" id=\"leader.st\">\r\n    <xsd:restriction base=\"xsd:string\">\r\n      <xsd:whiteSpace value=\"preserve\"/>\r\n      <xsd:pattern value=\"[\\d ]{5}[\\dA-Za-z ]{1}[\\dA-Za-z]{1}[\\dA-Za-z ]{3}(2| )(2| )[\\d ]{5}[\\dA-Za-z ]{3}(4500|    )\"/>\r\n    </xsd:restriction>\r\n  </xsd:simpleType>\r\n  <xsd:complexType name=\"controlFieldType\" id=\"controlfield.ct\">\r\n    <xsd:annotation>\r\n      <xsd:documentation>MARC21 Fields 001-009</xsd:documentation>\r\n    </xsd:annotation>\r\n    <xsd:simpleContent>\r\n      <xsd:extension base=\"controlDataType\">\r\n        <xsd:attribute name=\"id\" type=\"idDataType\" use=\"optional\"/>\r\n        <xsd:attribute name=\"tag\" type=\"controltagDataType\" use=\"required\"/>\r\n      </xsd:extension>\r\n    </xsd:simpleContent>\r\n  </xsd:complexType>\r\n  <xsd:simpleType name=\"controlDataType\" id=\"controlfield.st\">\r\n    <xsd:restriction base=\"xsd:string\">\r\n      <xsd:whiteSpace value=\"preserve\"/>\r\n    </xsd:restriction>\r\n  </xsd:simpleType>\r\n  <xsd:simpleType name=\"controltagDataType\" id=\"controltag.st\">\r\n    <xsd:restriction base=\"xsd:string\">\r\n      <xsd:whiteSpace value=\"preserve\"/>\r\n      <xsd:pattern value=\"00[1-9A-Za-z]{1}\"/>\r\n    </xsd:restriction>\r\n  </xsd:simpleType>\r\n  <xsd:complexType name=\"dataFieldType\" id=\"datafield.ct\">\r\n    <xsd:annotation>\r\n      <xsd:documentation>MARC21 Variable Data Fields 010-999</xsd:documentation>\r\n    </xsd:annotation>\r\n    <xsd:sequence maxOccurs=\"unbounded\">\r\n      <xsd:element name=\"subfield\" type=\"subfieldatafieldType\"/>\r\n    </xsd:sequence>\r\n    <xsd:attribute name=\"id\" type=\"idDataType\" use=\"optional\"/>\r\n    <xsd:attribute name=\"tag\" type=\"tagDataType\" use=\"required\"/>\r\n    <xsd:attribute name=\"ind1\" type=\"indicatorDataType\" use=\"required\"/>\r\n    <xsd:attribute name=\"ind2\" type=\"indicatorDataType\" use=\"required\"/>\r\n  </xsd:complexType>\r\n  <xsd:simpleType name=\"tagDataType\" id=\"tag.st\">\r\n    <xsd:restriction base=\"xsd:string\">\r\n      <xsd:whiteSpace value=\"preserve\"/>\r\n      <xsd:pattern value=\"(0([1-9A-Z][0-9A-Z])|0([1-9a-z][0-9a-z]))|(([1-9A-Z][0-9A-Z]{2})|([1-9a-z][0-9a-z]{2}))\"/>\r\n    </xsd:restriction>\r\n  </xsd:simpleType>\r\n  <xsd:simpleType name=\"indicatorDataType\" id=\"ind.st\">\r\n    <xsd:restriction base=\"xsd:string\">\r\n      <xsd:whiteSpace value=\"preserve\"/>\r\n      <xsd:pattern value=\"[\\da-z ]{1}\"/>\r\n    </xsd:restriction>\r\n  </xsd:simpleType>\r\n  <xsd:complexType name=\"subfieldatafieldType\" id=\"subfield.ct\">\r\n    <xsd:simpleContent>\r\n      <xsd:extension base=\"subfieldDataType\">\r\n        <xsd:attribute name=\"id\" type=\"idDataType\" use=\"optional\"/>\r\n        <xsd:attribute name=\"code\" type=\"subfieldcodeDataType\" use=\"required\"/>\r\n      </xsd:extension>\r\n    </xsd:simpleContent>\r\n  </xsd:complexType>\r\n  <xsd:simpleType name=\"subfieldDataType\" id=\"subfield.st\">\r\n    <xsd:restriction base=\"xsd:string\">\r\n      <xsd:whiteSpace value=\"preserve\"/>\r\n    </xsd:restriction>\r\n  </xsd:simpleType>\r\n  <xsd:simpleType name=\"subfieldcodeDataType\" id=\"code.st\">\r\n    <xsd:restriction base=\"xsd:string\">\r\n      <xsd:whiteSpace value=\"preserve\"/>     \r\n    </xsd:restriction>\r\n  </xsd:simpleType>\r\n  <xsd:simpleType name=\"idDataType\" id=\"id.st\">\r\n    <xsd:restriction base=\"xsd:ID\"/>\r\n  </xsd:simpleType>\r\n</xsd:schema>\r\n','collection','',''),
	(82,'XACML','2.0','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<xs:schema xmlns:xacml=\"urn:oasis:names:tc:xacml:2.0:policy:schema:os\" xmlns:xs=\"http://www.w3.org/2001/XMLSchema\" targetNamespace=\"urn:oasis:names:tc:xacml:2.0:policy:schema:os\" elementFormDefault=\"qualified\" attributeFormDefault=\"unqualified\">\r\n	<!-- -->\r\n	<xs:element name=\"PolicySet\" type=\"xacml:PolicySetType\"/>\r\n	<xs:complexType name=\"PolicySetType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:Description\" minOccurs=\"0\"/>\r\n			<xs:element ref=\"xacml:PolicySetDefaults\" minOccurs=\"0\"/>\r\n			<xs:element ref=\"xacml:Target\"/>\r\n			<xs:choice minOccurs=\"0\" maxOccurs=\"unbounded\">\r\n				<xs:element ref=\"xacml:PolicySet\"/>\r\n				<xs:element ref=\"xacml:Policy\"/>\r\n				<xs:element ref=\"xacml:PolicySetIdReference\"/>\r\n				<xs:element ref=\"xacml:PolicyIdReference\"/>\r\n				<xs:element ref=\"xacml:CombinerParameters\"/>\r\n				<xs:element ref=\"xacml:PolicyCombinerParameters\"/>\r\n				<xs:element ref=\"xacml:PolicySetCombinerParameters\"/>\r\n			</xs:choice>\r\n			<xs:element ref=\"xacml:Obligations\" minOccurs=\"0\"/>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"PolicySetId\" type=\"xs:anyURI\" use=\"required\"/>\r\n		<xs:attribute name=\"Version\" type=\"xacml:VersionType\" default=\"1.0\"/>\r\n		<xs:attribute name=\"PolicyCombiningAlgId\" type=\"xs:anyURI\" use=\"required\"/>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"CombinerParameters\" type=\"xacml:CombinerParametersType\"/>\r\n	<xs:complexType name=\"CombinerParametersType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:CombinerParameter\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n		</xs:sequence>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"CombinerParameter\" type=\"xacml:CombinerParameterType\"/>\r\n	<xs:complexType name=\"CombinerParameterType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:AttributeValue\"/>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"ParameterName\" type=\"xs:string\" use=\"required\"/>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"RuleCombinerParameters\" type=\"xacml:RuleCombinerParametersType\"/>\r\n	<xs:complexType name=\"RuleCombinerParametersType\">\r\n		<xs:complexContent>\r\n			<xs:extension base=\"xacml:CombinerParametersType\">\r\n				<xs:attribute name=\"RuleIdRef\" type=\"xs:string\" use=\"required\"/>\r\n			</xs:extension>\r\n		</xs:complexContent>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"PolicyCombinerParameters\" type=\"xacml:PolicyCombinerParametersType\"/>\r\n	<xs:complexType name=\"PolicyCombinerParametersType\">\r\n		<xs:complexContent>\r\n			<xs:extension base=\"xacml:CombinerParametersType\">\r\n				<xs:attribute name=\"PolicyIdRef\" type=\"xs:anyURI\" use=\"required\"/>\r\n			</xs:extension>\r\n		</xs:complexContent>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"PolicySetCombinerParameters\" type=\"xacml:PolicySetCombinerParametersType\"/>\r\n	<xs:complexType name=\"PolicySetCombinerParametersType\">\r\n		<xs:complexContent>\r\n			<xs:extension base=\"xacml:CombinerParametersType\">\r\n				<xs:attribute name=\"PolicySetIdRef\" type=\"xs:anyURI\" use=\"required\"/>\r\n			</xs:extension>\r\n		</xs:complexContent>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"PolicySetIdReference\" type=\"xacml:IdReferenceType\"/>\r\n	<xs:element name=\"PolicyIdReference\" type=\"xacml:IdReferenceType\"/>\r\n	<!-- -->\r\n	<xs:element name=\"PolicySetDefaults\" type=\"xacml:DefaultsType\"/>\r\n	<xs:element name=\"PolicyDefaults\" type=\"xacml:DefaultsType\"/>\r\n	<xs:complexType name=\"DefaultsType\">\r\n		<xs:sequence>\r\n			<xs:choice>\r\n				<xs:element ref=\"xacml:XPathVersion\"/>\r\n			</xs:choice>\r\n		</xs:sequence>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"XPathVersion\" type=\"xs:anyURI\"/>\r\n	<!-- -->\r\n	<xs:complexType name=\"IdReferenceType\">\r\n		<xs:simpleContent>\r\n			<xs:extension base=\"xs:anyURI\">\r\n				<xs:attribute name=\"Version\" type=\"xacml:VersionMatchType\" use=\"optional\"/>\r\n				<xs:attribute name=\"EarliestVersion\" type=\"xacml:VersionMatchType\" use=\"optional\"/>\r\n				<xs:attribute name=\"LatestVersion\" type=\"xacml:VersionMatchType\" use=\"optional\"/>\r\n			</xs:extension>\r\n		</xs:simpleContent>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:simpleType name=\"VersionType\">\r\n		<xs:restriction base=\"xs:string\">\r\n			<xs:pattern value=\"(\\d+\\.)*\\d+\"/>\r\n		</xs:restriction>\r\n	</xs:simpleType>\r\n	<!-- -->\r\n	<xs:simpleType name=\"VersionMatchType\">\r\n		<xs:restriction base=\"xs:string\">\r\n			<xs:pattern value=\"((\\d+|\\*)\\.)*(\\d+|\\*|\\+)\"/>\r\n		</xs:restriction>\r\n	</xs:simpleType>\r\n	<!-- -->\r\n	<xs:element name=\"Policy\" type=\"xacml:PolicyType\"/>\r\n	<xs:complexType name=\"PolicyType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:Description\" minOccurs=\"0\"/>\r\n			<xs:element ref=\"xacml:PolicyDefaults\" minOccurs=\"0\"/>\r\n			<xs:element ref=\"xacml:CombinerParameters\" minOccurs=\"0\"/>\r\n			<xs:element ref=\"xacml:Target\"/>\r\n			<xs:choice maxOccurs=\"unbounded\">\r\n				<xs:element ref=\"xacml:CombinerParameters\" minOccurs=\"0\"/>\r\n				<xs:element ref=\"xacml:RuleCombinerParameters\" minOccurs=\"0\"/>\r\n				<xs:element ref=\"xacml:VariableDefinition\"/>\r\n				<xs:element ref=\"xacml:Rule\"/>\r\n			</xs:choice>\r\n			<xs:element ref=\"xacml:Obligations\" minOccurs=\"0\"/>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"PolicyId\" type=\"xs:anyURI\" use=\"required\"/>\r\n		<xs:attribute name=\"Version\" type=\"xacml:VersionType\" default=\"1.0\"/>\r\n		<xs:attribute name=\"RuleCombiningAlgId\" type=\"xs:anyURI\" use=\"required\"/>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"Description\" type=\"xs:string\"/>\r\n	<!-- -->\r\n	<xs:element name=\"Rule\" type=\"xacml:RuleType\"/>\r\n	<xs:complexType name=\"RuleType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:Description\" minOccurs=\"0\"/>\r\n			<xs:element ref=\"xacml:Target\" minOccurs=\"0\"/>\r\n			<xs:element ref=\"xacml:Condition\" minOccurs=\"0\"/>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"RuleId\" type=\"xs:string\" use=\"required\"/>\r\n		<xs:attribute name=\"Effect\" type=\"xacml:EffectType\" use=\"required\"/>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:simpleType name=\"EffectType\">\r\n		<xs:restriction base=\"xs:string\">\r\n			<xs:enumeration value=\"Permit\"/>\r\n			<xs:enumeration value=\"Deny\"/>\r\n		</xs:restriction>\r\n	</xs:simpleType>\r\n	<!-- -->\r\n	<xs:element name=\"Target\" type=\"xacml:TargetType\"/>\r\n	<xs:complexType name=\"TargetType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:Subjects\" minOccurs=\"0\"/>\r\n			<xs:element ref=\"xacml:Resources\" minOccurs=\"0\"/>\r\n			<xs:element ref=\"xacml:Actions\" minOccurs=\"0\"/>\r\n			<xs:element ref=\"xacml:Environments\" minOccurs=\"0\"/>\r\n		</xs:sequence>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"Subjects\" type=\"xacml:SubjectsType\"/>\r\n	<xs:complexType name=\"SubjectsType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:Subject\" maxOccurs=\"unbounded\"/>\r\n		</xs:sequence>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"Subject\" type=\"xacml:SubjectType\"/>\r\n	<xs:complexType name=\"SubjectType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:SubjectMatch\" maxOccurs=\"unbounded\"/>\r\n		</xs:sequence>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"Resources\" type=\"xacml:ResourcesType\"/>\r\n	<xs:complexType name=\"ResourcesType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:Resource\" maxOccurs=\"unbounded\"/>\r\n		</xs:sequence>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"Resource\" type=\"xacml:ResourceType\"/>\r\n	<xs:complexType name=\"ResourceType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:ResourceMatch\" maxOccurs=\"unbounded\"/>\r\n		</xs:sequence>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"Actions\" type=\"xacml:ActionsType\"/>\r\n	<xs:complexType name=\"ActionsType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:Action\" maxOccurs=\"unbounded\"/>\r\n		</xs:sequence>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"Action\" type=\"xacml:ActionType\"/>\r\n	<xs:complexType name=\"ActionType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:ActionMatch\" maxOccurs=\"unbounded\"/>\r\n		</xs:sequence>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"Environments\" type=\"xacml:EnvironmentsType\"/>\r\n	<xs:complexType name=\"EnvironmentsType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:Environment\" maxOccurs=\"unbounded\"/>\r\n		</xs:sequence>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"Environment\" type=\"xacml:EnvironmentType\"/>\r\n	<xs:complexType name=\"EnvironmentType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:EnvironmentMatch\" maxOccurs=\"unbounded\"/>\r\n		</xs:sequence>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"SubjectMatch\" type=\"xacml:SubjectMatchType\"/>\r\n	<xs:complexType name=\"SubjectMatchType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:AttributeValue\"/>\r\n			<xs:choice>\r\n				<xs:element ref=\"xacml:SubjectAttributeDesignator\"/>\r\n				<xs:element ref=\"xacml:AttributeSelector\"/>\r\n			</xs:choice>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"MatchId\" type=\"xs:anyURI\" use=\"required\"/>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"ResourceMatch\" type=\"xacml:ResourceMatchType\"/>\r\n	<xs:complexType name=\"ResourceMatchType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:AttributeValue\"/>\r\n			<xs:choice>\r\n				<xs:element ref=\"xacml:ResourceAttributeDesignator\"/>\r\n				<xs:element ref=\"xacml:AttributeSelector\"/>\r\n			</xs:choice>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"MatchId\" type=\"xs:anyURI\" use=\"required\"/>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"ActionMatch\" type=\"xacml:ActionMatchType\"/>\r\n	<xs:complexType name=\"ActionMatchType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:AttributeValue\"/>\r\n			<xs:choice>\r\n				<xs:element ref=\"xacml:ActionAttributeDesignator\"/>\r\n				<xs:element ref=\"xacml:AttributeSelector\"/>\r\n			</xs:choice>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"MatchId\" type=\"xs:anyURI\" use=\"required\"/>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"EnvironmentMatch\" type=\"xacml:EnvironmentMatchType\"/>\r\n	<xs:complexType name=\"EnvironmentMatchType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:AttributeValue\"/>\r\n			<xs:choice>\r\n				<xs:element ref=\"xacml:EnvironmentAttributeDesignator\"/>\r\n				<xs:element ref=\"xacml:AttributeSelector\"/>\r\n			</xs:choice>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"MatchId\" type=\"xs:anyURI\" use=\"required\"/>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"VariableDefinition\" type=\"xacml:VariableDefinitionType\"/>\r\n	<xs:complexType name=\"VariableDefinitionType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:Expression\"/>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"VariableId\" type=\"xs:string\" use=\"required\"/>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"Expression\" type=\"xacml:ExpressionType\" abstract=\"true\"/>\r\n	<xs:complexType name=\"ExpressionType\" abstract=\"true\"/>\r\n	<!-- -->\r\n	<xs:element name=\"VariableReference\" type=\"xacml:VariableReferenceType\" substitutionGroup=\"xacml:Expression\"/>\r\n	<xs:complexType name=\"VariableReferenceType\">\r\n		<xs:complexContent>\r\n			<xs:extension base=\"xacml:ExpressionType\">\r\n				<xs:attribute name=\"VariableId\" type=\"xs:string\" use=\"required\"/>\r\n			</xs:extension>\r\n		</xs:complexContent>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"AttributeSelector\" type=\"xacml:AttributeSelectorType\" substitutionGroup=\"xacml:Expression\"/>\r\n	<xs:complexType name=\"AttributeSelectorType\">\r\n		<xs:complexContent>\r\n			<xs:extension base=\"xacml:ExpressionType\">\r\n				<xs:attribute name=\"RequestContextPath\" type=\"xs:string\" use=\"required\"/>\r\n				<xs:attribute name=\"DataType\" type=\"xs:anyURI\" use=\"required\"/>\r\n				<xs:attribute name=\"MustBePresent\" type=\"xs:boolean\" use=\"optional\" default=\"false\"/>\r\n			</xs:extension>\r\n		</xs:complexContent>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"ResourceAttributeDesignator\" type=\"xacml:AttributeDesignatorType\" substitutionGroup=\"xacml:Expression\"/>\r\n	<xs:element name=\"ActionAttributeDesignator\" type=\"xacml:AttributeDesignatorType\" substitutionGroup=\"xacml:Expression\"/>\r\n	<xs:element name=\"EnvironmentAttributeDesignator\" type=\"xacml:AttributeDesignatorType\" substitutionGroup=\"xacml:Expression\"/>\r\n	<!-- -->\r\n	<xs:complexType name=\"AttributeDesignatorType\">\r\n		<xs:complexContent>\r\n			<xs:extension base=\"xacml:ExpressionType\">\r\n				<xs:attribute name=\"AttributeId\" type=\"xs:anyURI\" use=\"required\"/>\r\n				<xs:attribute name=\"DataType\" type=\"xs:anyURI\" use=\"required\"/>\r\n				<xs:attribute name=\"Issuer\" type=\"xs:string\" use=\"optional\"/>\r\n				<xs:attribute name=\"MustBePresent\" type=\"xs:boolean\" use=\"optional\" default=\"false\"/>\r\n			</xs:extension>\r\n		</xs:complexContent>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"SubjectAttributeDesignator\" type=\"xacml:SubjectAttributeDesignatorType\" substitutionGroup=\"xacml:Expression\"/>\r\n	<xs:complexType name=\"SubjectAttributeDesignatorType\">\r\n		<xs:complexContent>\r\n			<xs:extension base=\"xacml:AttributeDesignatorType\">\r\n				<xs:attribute name=\"SubjectCategory\" type=\"xs:anyURI\" use=\"optional\" default=\"urn:oasis:names:tc:xacml:1.0:subject-category:access-subject\"/>\r\n			</xs:extension>\r\n		</xs:complexContent>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"AttributeValue\" type=\"xacml:AttributeValueType\" substitutionGroup=\"xacml:Expression\"/>\r\n	<xs:complexType name=\"AttributeValueType\" mixed=\"true\">\r\n		<xs:complexContent mixed=\"true\">\r\n			<xs:extension base=\"xacml:ExpressionType\">\r\n				<xs:sequence>\r\n					<xs:any namespace=\"##any\" processContents=\"lax\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n				</xs:sequence>\r\n				<xs:attribute name=\"DataType\" type=\"xs:anyURI\" use=\"required\"/>\r\n				<xs:anyAttribute namespace=\"##any\" processContents=\"lax\"/>\r\n			</xs:extension>\r\n		</xs:complexContent>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"Function\" type=\"xacml:FunctionType\" substitutionGroup=\"xacml:Expression\"/>\r\n	<xs:complexType name=\"FunctionType\">\r\n		<xs:complexContent>\r\n			<xs:extension base=\"xacml:ExpressionType\">\r\n				<xs:attribute name=\"FunctionId\" type=\"xs:anyURI\" use=\"required\"/>\r\n			</xs:extension>\r\n		</xs:complexContent>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"Condition\" type=\"xacml:ConditionType\"/>\r\n	<xs:complexType name=\"ConditionType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:Expression\"/>\r\n		</xs:sequence>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"Apply\" type=\"xacml:ApplyType\" substitutionGroup=\"xacml:Expression\"/>\r\n	<xs:complexType name=\"ApplyType\">\r\n		<xs:complexContent>\r\n			<xs:extension base=\"xacml:ExpressionType\">\r\n				<xs:sequence>\r\n					<xs:element ref=\"xacml:Expression\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n				</xs:sequence>\r\n				<xs:attribute name=\"FunctionId\" type=\"xs:anyURI\" use=\"required\"/>\r\n			</xs:extension>\r\n		</xs:complexContent>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"Obligations\" type=\"xacml:ObligationsType\"/>\r\n	<xs:complexType name=\"ObligationsType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:Obligation\" maxOccurs=\"unbounded\"/>\r\n		</xs:sequence>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"Obligation\" type=\"xacml:ObligationType\"/>\r\n	<xs:complexType name=\"ObligationType\">\r\n		<xs:sequence>\r\n			<xs:element ref=\"xacml:AttributeAssignment\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n		</xs:sequence>\r\n		<xs:attribute name=\"ObligationId\" type=\"xs:anyURI\" use=\"required\"/>\r\n		<xs:attribute name=\"FulfillOn\" type=\"xacml:EffectType\" use=\"required\"/>\r\n	</xs:complexType>\r\n	<!-- -->\r\n	<xs:element name=\"AttributeAssignment\" type=\"xacml:AttributeAssignmentType\"/>\r\n	<xs:complexType name=\"AttributeAssignmentType\" mixed=\"true\">\r\n		<xs:complexContent mixed=\"true\">\r\n			<xs:extension base=\"xacml:AttributeValueType\">\r\n				<xs:attribute name=\"AttributeId\" type=\"xs:anyURI\" use=\"required\"/>\r\n			</xs:extension>\r\n		</xs:complexContent>\r\n	</xs:complexType>\r\n	<!-- -->\r\n</xs:schema>\r\n','PolicySet','',''),
	(86,'DuplicatesReportData','1.0','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<xsd:schema xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\">\n\n<!-- the root element -->\n<xsd:element name=\"DuplicatesReport\" type=\"DuplicatesReportType\"/>\n\n<xsd:complexType name=\"DuplicatesReportType\">\n    <xsd:element name=\"duplicatesReportItem\" type=\"DuplicatesReportItemType\"/>\n</xsd:complexType>\n\n<xsd:complexType name=\"DuplicatesReportItemType\">\n    <xsd:sequence>\n      <xsd:attribute name=\"pid\"  />\n      <xsd:attribute name=\"title\"/>\n      <xsd:element name=\"duplicateItem\" type=\"DuplicatesListType\"/>\n    </xsd:sequence>\n</xsd:complexType>\n\n<xsd:complexType name=\"DuplicatesListType\">\n    <xsd:sequence>\n       <xsd:attribute name=\"pid\"  />\n       <xsd:attribute name=\"probability\"  />\n       <xsd:attribute name=\"duplicate\"  />\n    </xsd:sequence>\n</xsd:complexType>\n\n\n</xsd:schema>','DuplicatesReport','',''),
	(87,'ExtendedMODS','3.2 with extensions','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- edited with XML Spy v4.4 U (http://www.xmlspy.com) by Ray Denenberg  (Library of Congress) -->\n<xsd:schema xmlns:xlink=\"http://www.w3.org/1999/xlink\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" \nxmlns:dudro=\"http://www.deakin.edu.au/dro/schema.xsd\"\nxmlns=\"http://www.loc.gov/mods/v3\" targetNamespace=\"http://www.loc.gov/mods/v3\" elementFormDefault=\"qualified\" attributeFormDefault=\"unqualified\">\n	<xsd:import namespace=\"http://www.w3.org/XML/1998/namespace\" schemaLocation=\"http://www.w3.org/2001/xml.xsd\"/>\n	<xsd:import namespace=\"http://www.w3.org/1999/xlink\" schemaLocation=\"http://www.loc.gov/standards/xlink.xsd\"/>\n	<!-- \n\nMODS 3.2\nJune 1, 2006	\n\n***************************  List of changes from 3.1:\n\n1. <location><url>\n1.1. Added attribute \"note\" to allow for notes associated with the link.  \n    Tentative plan for 4.0 is to make it an element instead of an attribute, \n    and  wrap <url> and <urlNote> together. Can\'t do that in 3.2 \n    because it would not be compatible with 3.1. \n1.2. Added attribute \"access\",  enumerated list with values:\npreview\nraw object\nobject in context\n1.3  Add attribute \'usage\' under <url> with one enumerated value: \"primary display\".\n\n2. <physicalDescription><digitalOrigin>\nAdded enumerated values: \ndigitized microfilm \ndigitized other analog \n\n3. <part>\n3.1. Added attributes ID, type, order \n3.2. <part> may now be empty (minOccurs 0 on choice)\n\n4. ID attribute added.\n4.1 to relatedItem\n4.2 to note.\n\n5. The following  elements have been globalized:\n5.1 <dateCaptured>  (under <originInfo>)  dateCapturedType defined\n5.2 <edition> (under <originInfo> editionType defined\n5.3 <physicalLocation> (under <location>) physicalLocationType defined\n\n6. Elements whose type had been assumed to be \"string\",\n    but had not been explicitly typed, are now typed. \n\n7.  Add  subelement <genre> under <subject>.\n\n8. The schema location reference for xlink is changed to \n    http://www.loc.gov/standards/xlink.xsd. \n   (It was previously http://www.loc.gov/standards/mods/xlink.xsd. \n   The schema now resides in both places so that earlier versions \n    will not be affected, but it is now intended that the new copy \n    be referenced, outside of the mods directory, \n   so that other projects, e.g. mets, may reference it.)\n\n\n********************** end list of changes from 3.1\n\n\n*****  An instance of this schema is \n\n (1) a single MODS record:  \n	 -->\n	<xsd:element name=\"mods\" type=\"modsType\"/>\n	<!--  \nor \n\n(2) a collection of MODS records:  -->\n	<xsd:element name=\"modsCollection\">\n		<xsd:complexType>\n			<xsd:sequence>\n				<xsd:element ref=\"mods\" maxOccurs=\"unbounded\"/>\n			</xsd:sequence>\n		</xsd:complexType>\n	</xsd:element>\n	<!--  \n\n*****  End of \"instance\" definition\n\n******* Group definition. Forms the basis of the mods \n     record definintion, and also relatedItem. \n   Difference is that mods requires at least one element \n   and relatedItem does not.\n\n-->\n	<xsd:group name=\"modsGroup\">\n		<xsd:choice>\n			<xsd:element name=\"titleInfo\" type=\"titleInfoType\"/>\n			<xsd:element name=\"name\" type=\"nameType\"/>\n			<xsd:element name=\"typeOfResource\" type=\"typeOfResourceType\"/>\n			<xsd:element name=\"genre\" type=\"genreType\"/>\n			<xsd:element name=\"originInfo\" type=\"originInfoType\"/>\n			<xsd:element name=\"language\" type=\"languageType\"/>\n			<xsd:element name=\"physicalDescription\" type=\"physicalDescriptionType\"/>\n			<xsd:element name=\"abstract\" type=\"abstractType\"/>\n			<xsd:element name=\"tableOfContents\" type=\"tableOfContentsType\"/>\n			<xsd:element name=\"targetAudience\" type=\"targetAudienceType\"/>\n			<xsd:element name=\"note\" type=\"noteType\"/>\n			<xsd:element name=\"subject\" type=\"subjectType\"/>\n			<xsd:element name=\"classification\" type=\"classificationType\"/>\n			<xsd:element name=\"relatedItem\" type=\"relatedItemType\"/>\n			<xsd:element name=\"identifier\" type=\"identifierType\"/>\n			<xsd:element name=\"location\" type=\"locationType\"/>\n			<xsd:element name=\"accessCondition\" type=\"accessConditionType\"/>\n			<xsd:element name=\"part\" type=\"partType\"/>\n			<xsd:element name=\"extension\" type=\"extensionType\"/>\n			<xsd:element name=\"recordInfo\" type=\"recordInfoType\"/>\n		</xsd:choice>\n	</xsd:group>\n	<!--\n*****  Definition of a single MODS record\n-->\n	<xsd:complexType name=\"modsType\">\n		<xsd:group ref=\"modsGroup\" maxOccurs=\"unbounded\"/>\n		<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\n		<xsd:attribute name=\"version\" type=\"versionType\"/>\n	</xsd:complexType>\n	<!--\n*****  End of definition of a MODS record.\n \n***** Data type definitions for top level elements follow\n\n ********** titleInfoType definition **********\n -->\n	<xsd:complexType name=\"titleInfoType\">\n		<xsd:complexContent>\n			<xsd:extension base=\"baseTitleInfoType\">\n				<xsd:attribute name=\"type\" use=\"optional\">\n					<xsd:simpleType>\n						<xsd:annotation>\n							<xsd:documentation>if this attribute is omitted, then title relates to 245$a  $b  $n  and $p</xsd:documentation>\n						</xsd:annotation>\n						<xsd:restriction base=\"xsd:string\">\n							<xsd:enumeration value=\"abbreviated\">\n								<xsd:annotation>\n									<xsd:documentation>210</xsd:documentation>\n								</xsd:annotation>\n							</xsd:enumeration>\n							<xsd:enumeration value=\"translated\">\n								<xsd:annotation>\n									<xsd:documentation>242</xsd:documentation>\n								</xsd:annotation>\n							</xsd:enumeration>\n							<xsd:enumeration value=\"alternative\">\n								<xsd:annotation>\n									<xsd:documentation>246</xsd:documentation>\n								</xsd:annotation>\n							</xsd:enumeration>\n							<xsd:enumeration value=\"uniform\">\n								<xsd:annotation>\n									<xsd:documentation>240, 130</xsd:documentation>\n								</xsd:annotation>\n							</xsd:enumeration>\n						</xsd:restriction>\n					</xsd:simpleType>\n				</xsd:attribute>\n			</xsd:extension>\n		</xsd:complexContent>\n	</xsd:complexType>\n	<xsd:complexType name=\"baseTitleInfoType\">\n		<xsd:choice minOccurs=\"0\" maxOccurs=\"unbounded\">\n			<xsd:element name=\"title\" type=\"xsd:string\"/>\n			<xsd:element name=\"subTitle\" type=\"xsd:string\"/>\n			<xsd:element name=\"partNumber\" type=\"xsd:string\"/>\n			<xsd:element name=\"partName\" type=\"xsd:string\"/>\n			<xsd:element name=\"nonSort\" type=\"xsd:string\">\n				<xsd:annotation>\n					<xsd:documentation>All characters, including space, up to the first sort character.</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n		</xsd:choice>\n		<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\n		<xsd:attributeGroup ref=\"xlink:simpleLink\"/>\n		<xsd:attributeGroup ref=\"language\"/>\n		<xsd:attribute name=\"authority\" type=\"xsd:string\" use=\"optional\"/>\n		<xsd:attribute name=\"displayLabel\" use=\"optional\" type=\"xsd:string\"/>\n	</xsd:complexType>\n	<!-- \n **********  nameType definition  **********   		\n-->\n	<xsd:complexType name=\"nameType\">\n		<xsd:choice minOccurs=\"0\" maxOccurs=\"unbounded\">\n			<xsd:element name=\"namePart\" type=\"namePartType\"/>\n			<xsd:element name=\"displayForm\">\n				<xsd:annotation>\n					<xsd:documentation>245$c</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"affiliation\" type=\"xsd:string\">\n				<xsd:annotation>\n					<xsd:documentation>100, 700 $u</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"role\" type=\"roleType\"/>\n			<xsd:element name=\"description\" type=\"xsd:string\"/>\n		</xsd:choice>\n		<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\n		<xsd:attribute name=\"type\" type=\"nameTypeAttribute\" use=\"optional\"/>\n		<xsd:attribute name=\"authority\" use=\"optional\" type=\"xsd:string\">\n			<xsd:annotation>\n				<xsd:documentation>Value is from the list at  \n				http:/www.loc.gov/marc/sourcecode/authorityfile/authorityfilesource.html\n				</xsd:documentation>\n			</xsd:annotation>\n		</xsd:attribute>\n		<xsd:attributeGroup ref=\"xlink:simpleLink\"/>\n		<xsd:attributeGroup ref=\"language\"/>\n		<!--\n***** End declaration of elements for nameType.  \n\n***** Begin declaration of attributes for nameType.\n-->\n	</xsd:complexType>\n	<!--  \n***** Begin definition of subordinate types for nameType.\n-->\n	<xsd:complexType name=\"namePartType\">\n		<xsd:simpleContent>\n			<xsd:extension base=\"xsd:string\">\n				<xsd:attribute name=\"type\" use=\"optional\">\n					<xsd:simpleType>\n						<xsd:restriction base=\"xsd:string\">\n							<xsd:enumeration value=\"date\"/>\n							<xsd:enumeration value=\"family\"/>\n							<xsd:enumeration value=\"given\"/>\n							<xsd:enumeration value=\"termsOfAddress\"/>\n						</xsd:restriction>\n					</xsd:simpleType>\n				</xsd:attribute>\n			</xsd:extension>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<xsd:complexType name=\"roleType\">\n		<xsd:sequence maxOccurs=\"unbounded\">\n			<xsd:element name=\"roleTerm\">\n				<xsd:complexType>\n					<xsd:annotation>\n						<xsd:documentation>if it is a code: 100, 110, 111, 700, 710, 711 $4.\n					If it is text:100, 110, 700, 710 $e.		\n					</xsd:documentation>\n					</xsd:annotation>\n					<xsd:simpleContent>\n						<xsd:extension base=\"xsd:string\">\n							<xsd:attribute name=\"authority\" use=\"optional\" type=\"xsd:string\">\n								<xsd:annotation>\n									<xsd:documentation>The value of this attribute is from list at http://www.loc.gov/marc/sourcecode/relator/relatorsource.html.  If the value is \"marcrelator\" the content is from list at http://www.loc.gov/marc/sourcecode/relator/relatorlist.html\n </xsd:documentation>\n								</xsd:annotation>\n							</xsd:attribute>\n							<xsd:attribute name=\"type\" type=\"codeOrText\" use=\"optional\"/>\n						</xsd:extension>\n					</xsd:simpleContent>\n				</xsd:complexType>\n			</xsd:element>\n		</xsd:sequence>\n	</xsd:complexType>\n	<!--\n***** End definition of nameType.\n-->\n	<!--\n********** typeOfResourceType  definition **********   	  \n -->\n	<xsd:complexType name=\"typeOfResourceType\">\n		<xsd:annotation>\n			<xsd:documentation>LDR/6</xsd:documentation>\n		</xsd:annotation>\n		<xsd:simpleContent>\n			<xsd:extension base=\"resourceType\">\n				<xsd:attribute name=\"collection\" use=\"optional\">\n					<xsd:simpleType>\n						<xsd:restriction base=\"xsd:string\">\n							<xsd:enumeration value=\"yes\"/>\n						</xsd:restriction>\n					</xsd:simpleType>\n				</xsd:attribute>\n				<xsd:attribute name=\"manuscript\" use=\"optional\">\n					<xsd:simpleType>\n						<xsd:restriction base=\"xsd:string\">\n							<xsd:enumeration value=\"yes\"/>\n						</xsd:restriction>\n					</xsd:simpleType>\n				</xsd:attribute>\n			</xsd:extension>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<xsd:simpleType name=\"resourceType\">\n		<xsd:restriction base=\"xsd:string\">\n			<xsd:enumeration value=\"text\"/>\n			<xsd:enumeration value=\"cartographic\"/>\n			<xsd:enumeration value=\"notated music\"/>\n			<xsd:enumeration value=\"sound recording-musical\"/>\n			<xsd:enumeration value=\"sound recording-nonmusical\"/>\n			<xsd:enumeration value=\"sound recording\">\n				<xsd:annotation>\n					<xsd:documentation>Use for mixed musical and nonmusical, or when not specified whether musical or nonmusical.\n</xsd:documentation>\n				</xsd:annotation>\n			</xsd:enumeration>\n			<xsd:enumeration value=\"still image\"/>\n			<xsd:enumeration value=\"moving image\"/>\n			<xsd:enumeration value=\"three dimensional object\"/>\n			<xsd:enumeration value=\"software, multimedia\"/>\n			<xsd:enumeration value=\"mixed material\"/>\n		</xsd:restriction>\n	</xsd:simpleType>\n	<!--  \n********** genreType defintion  **********  	\n-->\n	<xsd:complexType name=\"genreType\">\n		<xsd:annotation>\n			<xsd:documentation>008/26, 008/33, 008/29, 008/30,  008/24+, 008/21, 008/25, 655</xsd:documentation>\n		</xsd:annotation>\n		<xsd:simpleContent>\n			<xsd:extension base=\"xsd:string\">\n				<xsd:attribute name=\"type\" use=\"optional\" type=\"xsd:string\"/>\n				<xsd:attribute name=\"authority\" use=\"optional\" type=\"xsd:string\">\n					<xsd:annotation>\n						<xsd:documentation> Value of this attribute may be from the list at:http://www.loc.gov/marc/sourcecode/genre/genresource.html.  If so, and if  the value is \'marcgt\' then the content is from list at http://www.loc.gov/marc/sourcecode/genre/genrelist.html.  The value may instead be a uri. </xsd:documentation>\n					</xsd:annotation>\n				</xsd:attribute>\n				<xsd:attributeGroup ref=\"language\"/>\n			</xsd:extension>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<!--  \n ********** originInfoType definition  ********** \n-->\n	<xsd:complexType name=\"originInfoType\">\n		<xsd:choice maxOccurs=\"unbounded\">\n			<xsd:element name=\"place\" type=\"placeType\"/>\n			<xsd:element name=\"publisher\" type=\"xsd:string\">\n				<xsd:annotation>\n					<xsd:documentation>260 $b</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"dateIssued\" type=\"dateType\">\n				<xsd:annotation>\n					<xsd:documentation>260$c, 008/07-14</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"dateCreated\" type=\"dateType\"/>\n			<xsd:element name=\"dateCaptured\" type=\"dateCapturedType\">\n				<xsd:annotation>\n					<xsd:documentation>033</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"dateValid\" type=\"dateType\"/>\n			<xsd:element name=\"dateModified\" type=\"dateType\">\n				<xsd:annotation>\n					<xsd:documentation>date resource modified, not record modified</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"copyrightDate\" type=\"dateType\"/>\n			<xsd:element name=\"dateOther\" type=\"dateOtherType\"/>\n			<xsd:element name=\"edition\" type=\"editionType\">\n				<xsd:annotation>\n					<xsd:documentation>250</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"issuance\">\n				<xsd:annotation>\n					<xsd:documentation>LDR/7</xsd:documentation>\n				</xsd:annotation>\n				<xsd:simpleType>\n					<xsd:restriction base=\"xsd:string\">\n						<xsd:enumeration value=\"continuing\"/>\n						<xsd:enumeration value=\"monographic\"/>\n					</xsd:restriction>\n				</xsd:simpleType>\n			</xsd:element>\n			<xsd:element name=\"frequency\" type=\"xsd:string\">\n				<xsd:annotation>\n					<xsd:documentation>310</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n		</xsd:choice>\n		<xsd:attributeGroup ref=\"language\"/>\n	</xsd:complexType>\n	<!-- \n\n*****   Subordinate datatype for originInfo\n-->\n	<xsd:complexType name=\"placeType\">\n		<xsd:sequence>\n			<xsd:element name=\"placeTerm\" type=\"placeTermType\" maxOccurs=\"unbounded\"/>\n		</xsd:sequence>\n	</xsd:complexType>\n	<xsd:complexType name=\"placeTermType\">\n		<xsd:annotation>\n			<xsd:documentation>260 $a if text. 008/15-17, 044 if a code</xsd:documentation>\n		</xsd:annotation>\n		<xsd:simpleContent>\n			<xsd:extension base=\"xsd:string\">\n				<xsd:attribute name=\"authority\" type=\"placeAuthority\" use=\"optional\"/>\n				<xsd:attribute name=\"type\" type=\"codeOrText\" use=\"optional\"/>\n			</xsd:extension>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<xsd:complexType name=\"dateCapturedType\">\n		<xsd:simpleContent>\n			<xsd:extension base=\"dateType\"/>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<xsd:simpleType name=\"editionType\">\n		<xsd:restriction base=\"xsd:string\"/>\n	</xsd:simpleType>\n	<!--   	 \n\n***** End definition of originInfo.\n\n********** languageType definition  **********  	                      	\n-->\n	<xsd:complexType name=\"languageType\">\n		<xsd:annotation>\n			<xsd:documentation>008/35-37, 041</xsd:documentation>\n		</xsd:annotation>\n		<xsd:sequence>\n			<xsd:element name=\"languageTerm\" maxOccurs=\"unbounded\">\n				<xsd:complexType>\n					<xsd:simpleContent>\n						<xsd:extension base=\"xsd:string\">\n							<xsd:attribute name=\"authority\" use=\"optional\">\n								<xsd:simpleType>\n									<xsd:restriction base=\"xsd:string\">\n										<xsd:enumeration value=\"rfc3066\"/>\n										<xsd:enumeration value=\"iso639-2b\"/>\n									</xsd:restriction>\n								</xsd:simpleType>\n							</xsd:attribute>\n							<xsd:attribute name=\"type\" type=\"codeOrText\" use=\"optional\"/>\n						</xsd:extension>\n					</xsd:simpleContent>\n				</xsd:complexType>\n			</xsd:element>\n		</xsd:sequence>\n		<xsd:attribute name=\"objectPart\"  type=\"xsd:string\" use=\"optional\"/>\n	</xsd:complexType>\n	<!-- \n********** physicalDescriptionType definition **********  		 		\n -->\n	<xsd:complexType name=\"physicalDescriptionType\">\n		<xsd:choice maxOccurs=\"unbounded\">\n			<xsd:element name=\"form\">\n				<xsd:annotation>\n					<xsd:documentation>008/23 or 29, 256</xsd:documentation>\n				</xsd:annotation>\n				<xsd:complexType>\n					<xsd:simpleContent>\n						<xsd:extension base=\"xsd:string\">\n							<xsd:attribute name=\"type\" use=\"optional\"  type=\"xsd:string\"/>\n							<xsd:attribute name=\"authority\" use=\"optional\"  type=\"xsd:string\">\n								<xsd:annotation>\n									<xsd:documentation>The value of this attribute is from the list at http://www.loc.gov/marc/sourcecode/form/formsource.html. If the value is \"marcform\" the content is from list at:\nhttp://www.loc.gov/marc/sourcecode/form/formlist.html\n\n\n						</xsd:documentation>\n								</xsd:annotation>\n							</xsd:attribute>\n						</xsd:extension>\n					</xsd:simpleContent>\n				</xsd:complexType>\n			</xsd:element>\n			<xsd:element name=\"reformattingQuality\">\n				<xsd:annotation>\n					<xsd:documentation>007/13ER</xsd:documentation>\n				</xsd:annotation>\n				<xsd:simpleType>\n					<xsd:restriction base=\"xsd:string\">\n						<xsd:enumeration value=\"access\"/>\n						<xsd:enumeration value=\"preservation\"/>\n						<xsd:enumeration value=\"replacement\"/>\n					</xsd:restriction>\n				</xsd:simpleType>\n			</xsd:element>\n			<xsd:element name=\"internetMediaType\" type=\"xsd:string\">\n				<xsd:annotation>\n					<xsd:documentation>856 $q</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"extent\" type=\"xsd:string\">\n				<xsd:annotation>\n					<xsd:documentation>300 $a and $c, and 306 $a</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"digitalOrigin\">\n				<xsd:simpleType>\n					<xsd:restriction base=\"xsd:string\">\n						<xsd:enumeration value=\"born digital\"/>\n						<xsd:enumeration value=\"reformatted digital\">\n							<xsd:annotation>\n					<xsd:documentation>007ER code a</xsd:documentation>\n				</xsd:annotation>\n				</xsd:enumeration>\n						<xsd:enumeration value=\"digitized microfilm\">\n							<xsd:annotation>\n								<xsd:documentation>\n						007/11ER MARC code b\n						</xsd:documentation>\n							</xsd:annotation>\n						</xsd:enumeration>\n						<xsd:enumeration value=\"digitized other analog\">\n							<xsd:annotation>\n								<xsd:documentation>\n					007/11ER MARC code d\n						</xsd:documentation>\n							</xsd:annotation>\n						</xsd:enumeration>\n					</xsd:restriction>\n				</xsd:simpleType>\n			</xsd:element>\n			<xsd:element name=\"note\" type=\"noteType\"/>\n		</xsd:choice>\n		<xsd:attributeGroup ref=\"language\"/>\n	</xsd:complexType>\n	<!--   \n********** abstractType definition  **********              \n -->\n	<xsd:complexType name=\"abstractType\">\n		<xsd:annotation>\n			<xsd:documentation>520</xsd:documentation>\n		</xsd:annotation>\n		<xsd:simpleContent>\n			<xsd:extension base=\"unstructuredText\"/>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<!--   \n********** tableOfContentsType definition  **********              \n -->\n	<xsd:complexType name=\"tableOfContentsType\">\n		<xsd:annotation>\n			<xsd:documentation>505</xsd:documentation>\n		</xsd:annotation>\n		<xsd:simpleContent>\n			<xsd:extension base=\"unstructuredText\"/>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<!--   \n********** targetAudienceType definition  **********              \n -->\n	<xsd:complexType name=\"targetAudienceType\">\n		<xsd:annotation>\n			<xsd:documentation>008/22, 521</xsd:documentation>\n		</xsd:annotation>\n		<xsd:simpleContent>\n			<xsd:extension base=\"xsd:string\">\n				<xsd:attribute name=\"authority\" use=\"optional\"  type=\"xsd:string\">\n					<xsd:annotation>\n						<xsd:documentation>The value of this attribute is from the list at http://www.loc.gov/marc/sourcecode/target/targetsource.html. \n						If the value of this attribute is \"marctarget\", the content from the list at http://www.loc.gov/marc/sourcecode/target/targetlist.html\n</xsd:documentation>\n					</xsd:annotation>\n				</xsd:attribute>\n				<xsd:attributeGroup ref=\"language\"/>\n			</xsd:extension>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<!--   \n********** noteType definition  **********              \n -->\n	<xsd:complexType name=\"noteType\">\n		<xsd:simpleContent>\n			<xsd:extension base=\"unstructuredText\">\n				<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\n				</xsd:extension>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<!--  \n ********** subjectType definition  **********  	 	\n-->\n	<xsd:complexType name=\"subjectType\">\n		<xsd:choice minOccurs=\"0\" maxOccurs=\"unbounded\">\n			<xsd:element name=\"topic\" type=\"xsd:string\">\n				<xsd:annotation>\n					<xsd:documentation>650, 6xx $x</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"geographic\" type=\"xsd:string\">\n				<xsd:annotation>\n					<xsd:documentation>651, 6xx $z</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"temporal\" type=\"dateType\">\n				<xsd:annotation>\n					<xsd:documentation>648, 6xx $y</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"titleInfo\" type=\"titleInfoType\">\n				<xsd:annotation>\n					<xsd:documentation>630</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"name\" type=\"nameType\">\n				<xsd:annotation>\n					<xsd:documentation>600, 610, 611</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"geographicCode\">\n				<xsd:complexType>\n					<xsd:annotation>\n						<xsd:documentation> 043</xsd:documentation>\n					</xsd:annotation>\n					<xsd:simpleContent>\n						<xsd:extension base=\"xsd:string\">\n							<xsd:attribute name=\"authority\" type=\"placeAuthority\" use=\"optional\"/>\n						</xsd:extension>\n					</xsd:simpleContent>\n				</xsd:complexType>\n			</xsd:element>\n			<xsd:element name=\"hierarchicalGeographic\" type=\"hierarchicalGeographicType\"/>\n			<xsd:element name=\"cartographics\">\n				<xsd:complexType>\n					<xsd:annotation>\n						<xsd:documentation>255</xsd:documentation>\n					</xsd:annotation>\n					<xsd:sequence>\n						<xsd:element name=\"scale\" minOccurs=\"0\" type=\"xsd:string\"/>\n						<xsd:element name=\"projection\" minOccurs=\"0\" type=\"xsd:string\"/>\n						<xsd:element name=\"coordinates\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"xsd:string\"/>\n					</xsd:sequence>\n				</xsd:complexType>\n			</xsd:element>\n			<xsd:element name=\"occupation\" type=\"xsd:string\">\n				<xsd:annotation>\n					<xsd:documentation> 656 </xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"genre\" type=\"xsd:string\"/>\n		</xsd:choice>\n		<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\n		<xsd:attributeGroup ref=\"xlink:simpleLink\"/>\n		<xsd:attribute name=\"authority\" use=\"optional\"  type=\"xsd:string\">\n			<xsd:annotation>\n				<xsd:documentation>Value is from the list at  http:/www.loc.gov/marc/sourcecode/subject/subjectsource.html</xsd:documentation>\n			</xsd:annotation>\n		</xsd:attribute>\n		<xsd:attributeGroup ref=\"language\"/>\n	</xsd:complexType>\n	<!--   \n\n-->\n	<xsd:complexType name=\"hierarchicalGeographicType\">\n		<xsd:annotation>\n			<xsd:documentation>752</xsd:documentation>\n		</xsd:annotation>\n		<xsd:choice maxOccurs=\"unbounded\">\n			<xsd:element name=\"continent\" type=\"xsd:string\"/>\n			<xsd:element name=\"country\" type=\"xsd:string\"/>\n			<xsd:element name=\"province\" type=\"xsd:string\"/>\n			<xsd:element name=\"region\" type=\"xsd:string\"/>\n			<xsd:element name=\"state\" type=\"xsd:string\"/>\n			<xsd:element name=\"territory\" type=\"xsd:string\"/>\n			<xsd:element name=\"county\" type=\"xsd:string\"/>\n			<xsd:element name=\"city\" type=\"xsd:string\"/>\n			<xsd:element name=\"island\" type=\"xsd:string\"/>\n			<xsd:element name=\"area\" type=\"xsd:string\"/>\n		</xsd:choice>\n	</xsd:complexType>\n	<!--\n**********   classificationType definition **********  	 \n-->\n	<xsd:complexType name=\"classificationType\">\n		<xsd:annotation>\n			<xsd:documentation>050, 082, 080, 060, 086, 084</xsd:documentation>\n		</xsd:annotation>\n		<xsd:simpleContent>\n			<xsd:extension base=\"xsd:string\">\n				<xsd:attribute name=\"authority\" use=\"optional\" type=\"xsd:string\">\n					<xsd:annotation>\n						<xsd:documentation>Value of this attribute is from the list at  http:/www.loc.gov/marc/sourcecode/classification/classificationsource.html</xsd:documentation>\n					</xsd:annotation>\n				</xsd:attribute>\n				<xsd:attribute name=\"edition\" use=\"optional\"  type=\"xsd:string\">\n					<xsd:annotation>\n						<xsd:documentation>edition qualifies authority, for authorities that have editions, e.g. DDC.</xsd:documentation>\n					</xsd:annotation>\n				</xsd:attribute>\n				<xsd:attributeGroup ref=\"language\"/>\n				<xsd:attribute name=\"displayLabel\" use=\"optional\"  type=\"xsd:string\"/>\n			</xsd:extension>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<!-- \n**********   relatedItemType definition **********  \n-->\n	<xsd:complexType name=\"relatedItemType\">\n		<xsd:group ref=\"modsGroup\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\n		<xsd:attribute name=\"type\" use=\"optional\">\n			<xsd:annotation>\n				<xsd:documentation>if 787; or 700, 710, 711, 730 with $t and ind2 = blank; then omit type.</xsd:documentation>\n			</xsd:annotation>\n			<xsd:simpleType>\n				<xsd:restriction base=\"xsd:string\">\n					<xsd:enumeration value=\"preceding\">\n						<xsd:annotation>\n							<xsd:documentation>780</xsd:documentation>\n						</xsd:annotation>\n					</xsd:enumeration>\n					<xsd:enumeration value=\"succeeding\">\n						<xsd:annotation>\n							<xsd:documentation>785</xsd:documentation>\n						</xsd:annotation>\n					</xsd:enumeration>\n					<xsd:enumeration value=\"original\">\n						<xsd:annotation>\n							<xsd:documentation>534, 786</xsd:documentation>\n						</xsd:annotation>\n					</xsd:enumeration>\n					<xsd:enumeration value=\"host\">\n						<xsd:annotation>\n							<xsd:documentation>772, 773</xsd:documentation>\n						</xsd:annotation>\n					</xsd:enumeration>\n					<xsd:enumeration value=\"constituent\">\n						<xsd:annotation>\n							<xsd:documentation>770, 774, 700, 710, 711 with $t and ind2 = 2</xsd:documentation>\n						</xsd:annotation>\n					</xsd:enumeration>\n					<xsd:enumeration value=\"series\">\n						<xsd:annotation>\n							<xsd:documentation>490, 440, 760, 800, 810, 811, 830</xsd:documentation>\n						</xsd:annotation>\n					</xsd:enumeration>\n					<xsd:enumeration value=\"otherVersion\">\n						<xsd:annotation>\n							<xsd:documentation>775</xsd:documentation>\n						</xsd:annotation>\n					</xsd:enumeration>\n					<xsd:enumeration value=\"otherFormat\">\n						<xsd:annotation>\n							<xsd:documentation>776</xsd:documentation>\n						</xsd:annotation>\n					</xsd:enumeration>\n					<xsd:enumeration value=\"isReferencedBy\">\n						<xsd:annotation>\n							<xsd:documentation>510</xsd:documentation>\n						</xsd:annotation>\n					</xsd:enumeration>\n				</xsd:restriction>\n			</xsd:simpleType>\n		</xsd:attribute>\n		<xsd:attribute name=\"displayLabel\" use=\"optional\" type=\"xsd:string\"/>\n		<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\n		<xsd:attributeGroup ref=\"xlink:simpleLink\"/>\n	</xsd:complexType>\n	<!--\n********** identifierType definition  **********  	                     	\n-->\n	<xsd:complexType name=\"identifierType\">\n		<xsd:annotation>\n			<xsd:documentation>010, 020, 022, 024, 028, 037, 856</xsd:documentation>\n		</xsd:annotation>\n		<xsd:simpleContent>\n			<xsd:extension base=\"xsd:string\">\n				<xsd:attribute name=\"type\" use=\"optional\">\n					<xsd:annotation>\n						<xsd:documentation>Suggested values include (but are not limited to):  \"hdl\",\"doi\",\"isbn\", \"isrc\",  \"ismn\" \"issn\", \"issue number\", \"istc\",  \"lccn\",  \"local\", \"matrix number\", \"music publisher\", \"music plate\", \"sici\", \"uri\", \"upc\", \"videorecording identifier\", \"stock number\"</xsd:documentation>\n					</xsd:annotation>\n				</xsd:attribute>\n				<xsd:attribute name=\"displayLabel\" use=\"optional\" type=\"xsd:string\">\n					<xsd:annotation>\n						<xsd:documentation>856$3</xsd:documentation>\n					</xsd:annotation>\n				</xsd:attribute>\n				<xsd:attribute name=\"invalid\" use=\"optional\">\n					<xsd:annotation>\n						<xsd:documentation>$z in 0XX fields</xsd:documentation>\n					</xsd:annotation>\n					<xsd:simpleType>\n						<xsd:restriction base=\"xsd:string\">\n							<xsd:enumeration value=\"yes\"/>\n						</xsd:restriction>\n					</xsd:simpleType>\n				</xsd:attribute>\n				<xsd:attributeGroup ref=\"language\"/>\n			</xsd:extension>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<!--  	 \n********** locationType definition  **********  	                     	\n-->\n	<xsd:complexType name=\"locationType\">\n		<xsd:sequence>\n			<xsd:element name=\"physicalLocation\" type=\"physicalLocationType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\n			<xsd:element name=\"url\" type=\"urlType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\n		</xsd:sequence>\n	</xsd:complexType>\n	<!--  \n********** urlType definition  (subordinate to locationType) **********              \n -->\n	<xsd:complexType name=\"urlType\">\n		<xsd:annotation>\n			<xsd:documentation>856$u</xsd:documentation>\n		</xsd:annotation>\n		<xsd:simpleContent>\n			<xsd:extension base=\"xsd:anyURI\">\n				<xsd:attribute name=\"dateLastAccessed\" use=\"optional\"/>\n				<xsd:attribute name=\"displayLabel\" use=\"optional\" type=\"xsd:string\">\n					<xsd:annotation>\n						<xsd:documentation>856$3</xsd:documentation>\n					</xsd:annotation>\n				</xsd:attribute>\n				<xsd:attribute name=\"note\" use=\"optional\" type=\"xsd:string\">\n					<xsd:annotation>\n						<xsd:documentation>856$z</xsd:documentation>\n					</xsd:annotation>\n				</xsd:attribute>\n				<xsd:attribute name=\"access\" use=\"optional\">\n					<xsd:simpleType>\n						<xsd:restriction base=\"xsd:string\">\n							<xsd:enumeration value=\"preview\"/>\n							<xsd:enumeration value=\"raw object\"/>\n							<xsd:enumeration value=\"object in context\"/>\n						</xsd:restriction>\n					</xsd:simpleType>\n				</xsd:attribute>\n				<xsd:attribute name=\"usage\" use=\"optional\">\n					<xsd:simpleType>\n						<xsd:restriction base=\"xsd:string\">\n							<xsd:enumeration value=\"primary display\"/>\n													</xsd:restriction>\n					</xsd:simpleType>\n				</xsd:attribute>\n			</xsd:extension>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<!--  \n  \n********** physicalLocationType definition  (subordinate to locationType) **********              \n -->\n	<xsd:complexType name=\"physicalLocationType\">\n		<xsd:annotation>\n			<xsd:documentation>852 $a $b $j $e</xsd:documentation>\n		</xsd:annotation>\n		<xsd:simpleContent>\n			<xsd:extension base=\"sourceType\">\n				<xsd:attribute name=\"type\" use=\"optional\" type=\"xsd:string\"/>\n				<xsd:attribute name=\"displayLabel\" use=\"optional\" type=\"xsd:string\">\n					<xsd:annotation>\n						<xsd:documentation>852$3</xsd:documentation>\n					</xsd:annotation>\n				</xsd:attribute>\n			</xsd:extension>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<!--\n********** accessConditionType definition  **********              \n -->\n	<xsd:complexType name=\"accessConditionType\">\n		<xsd:annotation>\n			<xsd:documentation>506, 540</xsd:documentation>\n		</xsd:annotation>\n		<xsd:simpleContent>\n			<xsd:extension base=\"unstructuredText\"/>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<!-- \n********** partType definition **********  \n-->\n	<xsd:complexType name=\"partType\">\n		<xsd:choice minOccurs=\"0\" maxOccurs=\"unbounded\">\n			<!--minOccurs=\"0\" allows <part> to be optionally empty,   when the ID and type attribute values contain all the information needed about the part. -->\n			<xsd:element name=\"detail\" type=\"detailType\"/>\n			<xsd:element name=\"extent\" type=\"extentType\"/>\n			<xsd:element name=\"date\" type=\"baseDateType\">\n				<xsd:annotation>\n					<xsd:documentation>Use only if different from date of resource being described in \'originInfo\'</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"text\" type=\"unstructuredText\"/>\n		</xsd:choice>\n		<xsd:attribute name=\"ID\" type=\"xsd:ID\" use=\"optional\"/>\n		<xsd:attribute name=\"type\" type=\"xsd:string\" use=\"optional\"/>\n		<xsd:attribute name=\"order\" type=\"xsd:integer\" use=\"optional\"/>\n	</xsd:complexType>\n	<xsd:complexType name=\"detailType\">\n		<xsd:choice maxOccurs=\"unbounded\">\n			<xsd:element name=\"number\" type=\"xsd:string\"/>\n			<xsd:element name=\"caption\" type=\"xsd:string\"/>\n			<xsd:element name=\"title\" type=\"xsd:string\">\n				<xsd:annotation>\n					<xsd:documentation>Use only if different than main title of resource being described</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n		</xsd:choice>\n		<xsd:attribute name=\"type\" use=\"optional\" type=\"xsd:string\">\n			<xsd:annotation>\n				<xsd:documentation>Suggested values: part, volume, issue, chapter, section, paragraph, track. These values are used regardless of linguistic term)</xsd:documentation>\n			</xsd:annotation>\n		</xsd:attribute>\n		<xsd:attribute name=\"level\" type=\"xsd:positiveInteger\" use=\"optional\">\n			<xsd:annotation>\n				<xsd:documentation>Hierarchical level (level of enumeration) of a given detail element when there are multiple detail elements;  top level is 1. For example assume two details, volume and  issue; for volume (which is at a higher level hierarchically):  type=\"volume\" level=\"1\"; for issue:  type=\"issue\" level=\"2\".\n</xsd:documentation>\n			</xsd:annotation>\n		</xsd:attribute>\n	</xsd:complexType>\n	<xsd:complexType name=\"extentType\">\n		<xsd:sequence>\n			<xsd:annotation>\n				<xsd:documentation> If \'start\' but not \'end\'  is supplied, it should be assumed that the end page is unknown. A single page is indicated by presence of both \'start\' and \'end\' with same value. </xsd:documentation>\n			</xsd:annotation>\n			<xsd:element name=\"start\" minOccurs=\"0\" type=\"xsd:string\">\n				<xsd:annotation>\n					<xsd:documentation>  Use for first page or begin minute</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"end\" minOccurs=\"0\" type=\"xsd:string\">\n				<xsd:annotation>\n					<xsd:documentation> Use for last page, end minutes, or (together with start element) single page</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"total\" type=\"xsd:positiveInteger\" minOccurs=\"0\">\n				<xsd:annotation>\n					<xsd:documentation> A cardinal rather than ordinal number. Use for a total number of pages or minutes. \n</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"list\" minOccurs=\"0\" type=\"xsd:string\">\n				<xsd:annotation>\n					<xsd:documentation> Use for an unparsed statement, e.g. p. 5-12. </xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n		</xsd:sequence>\n		<xsd:attribute name=\"unit\"  type=\"xsd:string\">\n			<xsd:annotation>\n				<xsd:documentation>  suggested values: pages, minutes</xsd:documentation>\n			</xsd:annotation>\n		</xsd:attribute>\n		\n	</xsd:complexType>\n	<!-- \n\n********** extensionType definition **********  \n-->\n<dudro:complexType name=\"extensionType\" mixed=\"true\">\n	<dudro:annotation>\n		<dudro:documentation>Extension for datasets doc type set up for ANDS Seeding the Commons Project. Note: in MODS 3.4+, is extensionDefinition not extensionType</dudro:documentation>\n	</dudro:annotation>\n	<dudro:element name=\"dudro-contact\" type=\"contactType\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\n		<dudro:annotation>\n			<dudro:documentation>Contact details for requesting access to dataset</dudro:documentation>\n		</dudro:annotation>\n	<dudro:attribute name=\"type\" use=\"optional\" type=\"dudro:string\" />\n		<dudro:annotation>\n			<dudro:documentation>ust a placeholder at the moment, to demonstrate how to set up an attribute</dudro:documentation>\n		</dudro:annotation>\n    <dudro:sequence>\n        <dudro:any processContents=\"lax\" maxOccurs=\"unbounded\" />\n     </dudro:sequence>\n</dudro:complexType>\n\n<dudro:complexType name=\"contactType\">\n	<dudro:choice maxOccurs=\"unbounded\">\n		<dudro:element name=\"dudro-contactDetails\" type=\"dudro:string\"/>\n			<dudro:annotation>\n				<dudro:documentation>Use for combined name/address field</dudro:documentation>\n			</dudro:annotation>\n		<dudro:element name=\"dudro-name\" type=\"dudro:string\"/>\n			<dudro:annotation>\n				<dudro:documentation>Name of contact person</dudro:documentation>\n			</dudro:annotation>\n		<dudro:element name=\"dudro-address\" type=\"dudro:string\"/>\n			<dudro:annotation>\n				<dudro:documentation>address of contact person; can be email, URL or physical address, consistent with \"contact type\" attribute</dudro:documentation>\n			</dudro:annotation>\n	</dudro:choice>\n	<dudro:attribute name=\"type\" use=\"optional\" type=\"dudro:string\" />\n		<dudro:annotation>\n			<dudro:documentation>Type of contact, e.g. any, email, URL, physical location. Currently using \"any\" to cover all types of contact</dudro:documentation>\n		</dudro:annotation>\n</dudro:complexType>\n\n\n	<!--  \n**********  recordInfoType definition **********   \n-->\n	<xsd:complexType name=\"recordInfoType\">\n		<xsd:choice maxOccurs=\"unbounded\">\n			<xsd:element name=\"recordContentSource\" type=\"sourceType\">\n				<xsd:annotation>\n					<xsd:documentation>040 $a, $d</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"recordCreationDate\" type=\"dateType\">\n				<xsd:annotation>\n					<xsd:documentation>008/00-05</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"recordChangeDate\" type=\"dateType\">\n				<xsd:annotation>\n					<xsd:documentation>005</xsd:documentation>\n				</xsd:annotation>\n			</xsd:element>\n			<xsd:element name=\"recordIdentifier\">\n				<xsd:annotation>\n					<xsd:documentation>001</xsd:documentation>\n				</xsd:annotation>\n				<xsd:complexType>\n					<xsd:simpleContent>\n						<xsd:extension base=\"xsd:string\">\n							<xsd:attribute name=\"source\" use=\"optional\" type=\"xsd:string\">\n								<xsd:annotation>\n									<xsd:documentation>Who supplied the identifier. From 003</xsd:documentation>\n								</xsd:annotation>\n							</xsd:attribute>\n						</xsd:extension>\n					</xsd:simpleContent>\n				</xsd:complexType>\n			</xsd:element>\n			<xsd:element name=\"languageOfCataloging\" type=\"languageType\">\n				<xsd:annotation>\n					<xsd:documentation>040$b</xsd:documentation>\n				</xsd:annotation>\n				<!-- This applies to the record at large. Any top level element can indicate a language, which overides this value for that element. -->\n			</xsd:element>\n			<xsd:element name=\"recordOrigin\" type=\"xsd:string\"/>\n		</xsd:choice>\n		<xsd:attributeGroup ref=\"language\"/>\n		<!-- This applies to the language of RecordInfo only. I.e. for recordContentSource and for source of identifier. -->\n	</xsd:complexType>\n	<!--  \n***** End  data type definitions for top level elements.  \n\n***** Begin global definitions. \n-->\n	<!--\n********** unstructuredText Definition  ********** \n-->\n	<xsd:complexType name=\"unstructuredText\">\n		<xsd:annotation>\n			<xsd:documentation>If the link  is supplied it is in lieu of or in addition to the content.</xsd:documentation>\n		</xsd:annotation>\n		<xsd:simpleContent>\n			<xsd:extension base=\"xsd:string\">\n				<xsd:attributeGroup ref=\"xlink:simpleLink\"/>\n				<xsd:attributeGroup ref=\"language\"/>\n				<xsd:attribute name=\"displayLabel\" use=\"optional\" type=\"xsd:string\"/>\n				<xsd:attribute name=\"type\" type=\"xsd:string\" use=\"optional\"/>\n			</xsd:extension>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<!--  \n********** dateType definition  **********  \n-->\n	<xsd:complexType name=\"baseDateType\">\n		<xsd:simpleContent>\n			<xsd:extension base=\"xsd:string\">\n				<xsd:attribute name=\"encoding\" use=\"optional\">\n					<xsd:annotation>\n						<xsd:documentation>if omitted, free text is assumed</xsd:documentation>\n					</xsd:annotation>\n					<xsd:simpleType>\n						<xsd:restriction base=\"xsd:string\">\n							<xsd:enumeration value=\"w3cdtf\"/>\n							<xsd:enumeration value=\"iso8601\"/>\n							<xsd:enumeration value=\"marc\"/>\n						</xsd:restriction>\n					</xsd:simpleType>\n				</xsd:attribute>\n				<xsd:attribute name=\"qualifier\" use=\"optional\">\n					<xsd:simpleType>\n						<xsd:restriction base=\"xsd:string\">\n							<xsd:enumeration value=\"approximate\"/>\n							<xsd:enumeration value=\"inferred\"/>\n							<xsd:enumeration value=\"questionable\"/>\n						</xsd:restriction>\n					</xsd:simpleType>\n				</xsd:attribute>\n				<xsd:attribute name=\"point\" use=\"optional\">\n					<xsd:simpleType>\n						<xsd:restriction base=\"xsd:string\">\n							<xsd:enumeration value=\"start\"/>\n							<xsd:enumeration value=\"end\"/>\n						</xsd:restriction>\n					</xsd:simpleType>\n				</xsd:attribute>\n			</xsd:extension>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<xsd:complexType name=\"dateType\">\n		<xsd:simpleContent>\n			<xsd:extension base=\"baseDateType\">\n				<xsd:attribute name=\"keyDate\" use=\"optional\">\n					<xsd:simpleType>\n						<xsd:annotation>\n							<xsd:documentation>So that a particular date may be distinguished among several dates. Thus for example when sorting MODS records by date, a date with keyDate=\"yes\" would be the date to sort on. It should occur only for one date at most in a given record.</xsd:documentation>\n						</xsd:annotation>\n						<xsd:restriction base=\"xsd:string\">\n							<xsd:enumeration value=\"yes\"/>\n						</xsd:restriction>\n					</xsd:simpleType>\n				</xsd:attribute>\n			</xsd:extension>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<xsd:complexType name=\"dateOtherType\">\n		<xsd:simpleContent>\n			<xsd:extension base=\"dateType\">\n				<xsd:attribute name=\"type\" use=\"optional\" type=\"xsd:string\"/>\n			</xsd:extension>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<!--  \n********** sourceType definition  **********  	                       	  \n-->\n	<xsd:complexType name=\"sourceType\">\n		<xsd:simpleContent>\n			<xsd:extension base=\"xsd:string\">\n				<xsd:attribute name=\"authority\" use=\"optional\" type=\"xsd:string\">\n					<xsd:annotation>\n						<xsd:documentation>Value of this attribute is from list at: http://www.loc.gov/marc/sourcecode/organization/organizationsource.html.  If the value is \"marcorg\", see: http://www.loc.gov/marc/organizations</xsd:documentation>\n					</xsd:annotation>\n				</xsd:attribute>\n				<xsd:attributeGroup ref=\"language\"/>\n			</xsd:extension>\n		</xsd:simpleContent>\n	</xsd:complexType>\n	<!--  \n ********** language attribute group definition  **********  	                       	  \n-->\n	<xsd:attributeGroup name=\"language\">\n		<xsd:attribute name=\"lang\" use=\"optional\" type=\"xsd:string\">\n			<xsd:annotation>\n				<xsd:documentation>ISO 639-2b</xsd:documentation>\n			</xsd:annotation>\n		</xsd:attribute>\n		<xsd:attribute ref=\"xml:lang\" use=\"optional\"/>\n		<xsd:attribute name=\"script\" use=\"optional\" type=\"xsd:string\"/>\n		<xsd:attribute name=\"transliteration\" use=\"optional\" type=\"xsd:string\"/>\n	</xsd:attributeGroup>\n	<!--  \n   ********** definition of codeOrText type used by type attribute \n   for elements that distinguish code from text  **********  	                       	  \n -->\n	<xsd:simpleType name=\"codeOrText\">\n		<xsd:restriction base=\"xsd:string\">\n			<xsd:enumeration value=\"code\"/>\n			<xsd:enumeration value=\"text\"/>\n		</xsd:restriction>\n	</xsd:simpleType>\n	<!--  \n    ********** definition of placeAuthority type used by authority attribute\n      for  placeType and geographic  **********  	                       	  \n -->\n	<xsd:simpleType name=\"placeAuthority\">\n		<xsd:restriction base=\"xsd:string\">\n			<xsd:enumeration value=\"marcgac\"/>\n			<xsd:enumeration value=\"marccountry\"/>\n			<xsd:enumeration value=\"iso3166\"/>\n		</xsd:restriction>\n	</xsd:simpleType>\n	<!--  \n    ********** definition of nameTypeAttribute used by name attribute\n      \"type\"  **********  	                       	  \n -->\n	<xsd:simpleType name=\"nameTypeAttribute\">\n		<xsd:restriction base=\"xsd:string\">\n			<xsd:enumeration value=\"personal\">\n				<xsd:annotation>\n					<xsd:documentation>100, 700</xsd:documentation>\n				</xsd:annotation>\n			</xsd:enumeration>\n			<xsd:enumeration value=\"corporate\">\n				<xsd:annotation>\n					<xsd:documentation>110, 710.</xsd:documentation>\n				</xsd:annotation>\n			</xsd:enumeration>\n			<xsd:enumeration value=\"conference\">\n				<xsd:annotation>\n					<xsd:documentation>111, 711</xsd:documentation>\n				</xsd:annotation>\n			</xsd:enumeration>\n		</xsd:restriction>\n	</xsd:simpleType>\n	<xsd:simpleType name=\"versionType\">\n		<xsd:restriction base=\"xsd:string\">\n			<xsd:enumeration value=\"3.2\"/>\n		</xsd:restriction>\n	</xsd:simpleType>\n</xsd:schema>','mods','mods','dudro');
